INSERT INTO `ps_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(10, 1, 1, '<p>bąbelki do wciskania</p>\n<h2>wyraźny dźwięk POP! podczas wciskania</h2>\n<p>wykonana z wysokiej jakości tworzywa ABS</p>\n<p>Zabawka stymuluje zmysł dotyku i rozwój motoryki małej u dzieci.</p>\n<p>BĄBELKI DO WCISKANIA, ZABAWKA SENSORYCZNA</p>\n<p>---</p>\n<p>rzeczywiste zdjęcia</p>\n<p><strong>dostępne 5 wersji kolorystycznych</strong></p>\n<p></p>\n<p>Dostępne różne kolory. W przypadku braku wskazania we wiadomości dla sprzedającego bezpośrednio w formularzu zakupowym \"pole wiadomość dla sprzedawcy\" - wzór niespodzianka, zawsze pięknie tęczowy widoczny na zdjęciach. Można wskazać również opcję kolorystyczną dla dziewczynki lub chłopca.</p>\n<p>Uwaga! Zabawki przeznaczone do użytku pod nadzorem dorosłego.</p>\n<p></p>', '<p>Fidget Toy Dimple</p>\n<p>#bubble #push</p>\n<h2>POP it!</h2>', 'fidget-simple-dimple-pop-it', '', '', '', 'Fidget Simple Dimple POP IT', '', '', '', ''),
(11, 1, 1, '<h1 style=\"font-size:24px;line-height:1.3;color:#222222;font-family:\'Open Sans\', sans-serif;\">KAWAII JAPAN STYLE AWOKADO AVOCADO</h1>\n<p style=\"font-size:16px;color:#222222;font-family:\'Open Sans\', sans-serif;line-height:21px;\">Sposób na zajęcie niecierpliwych dłoni jak również świetny do ćwiczeń sensorycznych - gniotka można ugniatać na wiele sposobów. Doskonały ściskacz do rozwijania sprawności ruchowej dłoni (mała motoryka).</p>\n<p style=\"font-size:16px;color:#222222;font-family:\'Open Sans\', sans-serif;line-height:21px;\"></p>\n<h2 style=\"line-height:1.3;font-size:18px;font-family:\'Open Sans\', sans-serif;color:#222222;\">100% oryginalne Squishy!</h2>\n<p style=\"font-size:16px;color:#222222;font-family:\'Open Sans\', sans-serif;line-height:21px;\">Pianka najlepszej jakości</p>\n<p style=\"font-size:16px;color:#222222;font-family:\'Open Sans\', sans-serif;line-height:21px;\"><b>Designed in Japan</b></p>\n<p style=\"font-size:16px;color:#222222;font-family:\'Open Sans\', sans-serif;line-height:21px;\"><b>Super pomysł na prezent !!!</b></p>\n<p style=\"font-size:16px;color:#222222;font-family:\'Open Sans\', sans-serif;line-height:21px;\"></p>\n<p style=\"font-size:16px;color:#222222;font-family:\'Open Sans\', sans-serif;line-height:21px;\">Wysokość: 13,5cm.</p>\n<p style=\"font-size:16px;color:#222222;font-family:\'Open Sans\', sans-serif;line-height:21px;\">Szerokość: 8,5cm.</p>\n<p style=\"font-size:16px;color:#222222;font-family:\'Open Sans\', sans-serif;line-height:21px;\">Zapach: przyjemny zapach słodkości</p>\n<p style=\"font-size:16px;color:#222222;font-family:\'Open Sans\', sans-serif;line-height:21px;\">Materiał: miękka pianka spełniająca normy EN71-3</p>', '<h2 style=\"line-height:1.3;font-size:18px;font-family:\'Open Sans\', sans-serif;color:#222222;\">WSPANIAŁY PACHNĄCY GNIOTEK</h2>\n<p style=\"font-size:16px;color:#222222;font-family:\'Open Sans\', sans-serif;line-height:21px;\">Ściskacz Squishy - rewelacyjna zabawka antystresowa</p>\n<h1 style=\"font-size:24px;line-height:1.3;color:#222222;font-family:\'Open Sans\', sans-serif;\">KAWAII JAPAN STYLE AWOKADO AVOCADO</h1>', 'squishy-avocado', '', '', '', 'Squishy Avocado', '', '', '', ''),
(12, 1, 1, '<h1>KAWAII JAPAN STYLE POO KUPKA</h1>\n<p>Sposób na zajęcie niecierpliwych dłoni jak również świetny do ćwiczeń sensorycznych - gniotka można ugniatać na wiele sposobów. Doskonały ściskacz do rozwijania sprawności ruchowej dłoni (mała motoryka).</p>\n<p> </p>\n<h2>100% oryginalne Squishy!</h2>\n<p>Pianka najlepszej jakości</p>\n<p><strong>Designed in Japan</strong></p>\n<p><strong>Super pomysł na prezent !!!</strong></p>\n<p>Wysokość: 12cm</p>\n<p>Zapach: przyjemny zapach słodkości</p>\n<p>Materiał: miękka pianka spełniająca normy EN71-3</p>', '<h2>WSPANIAŁY PACHNĄCY DUŻY GNIOTEK</h2>\n<p>Ściskacz Squishy Jumbo - rewelacyjna zabawka antystresowa</p>\n<h1>KAWAII JAPAN STYLE POO KUPKA</h1>', 'squishy-poo-jumbo', '', '', '', 'Squishy poo jumbo', '', '', '', ''),
(13, 1, 1, '<h1>KAWAII JAPAN STYLE SYRENKA EMOJI</h1>\n<p>Sposób na zajęcie niecierpliwych dłoni jak również świetny do ćwiczeń sensorycznych - gniotka można ugniatać na wiele sposobów. Doskonały ściskacz do rozwijania sprawności ruchowej dłoni (mała motoryka).</p>\n<p> </p>\n<h2>100% oryginalne Squishy!</h2>\n<p>Pianka najlepszej jakości</p>\n<p><strong>Designed in Japan</strong></p>\n<p><strong>Super pomysł na prezent !!!</strong></p>\n<p>Wysokość: 11cm ; szerokość: 14cm</p>\n<p>Zapach: przyjemny zapach słodkości</p>\n<p>Materiał: miękka pianka spełniająca normy EN71-3</p>', '<h2>WSPANIAŁY PACHNĄCY DUŻY GNIOTEK</h2>\n<p>Ściskacz Squishy Jumbo - rewelacyjna zabawka antystresowa</p>\n<h1>KAWAII JAPAN STYLE SYRENKA EMOJI</h1>', 'squishy-syrenka-jumbo', '', '', '', 'Squishy syrenka jumbo', '', '', '', ''),
(14, 1, 1, '<h1>KAWAII JAPAN STYLE SOWA OWL</h1>\n<p>Sposób na zajęcie niecierpliwych dłoni jak również świetny do ćwiczeń sensorycznych - gniotka można ugniatać na wiele sposobów. Doskonały ściskacz do rozwijania sprawności ruchowej dłoni (mała motoryka).</p>\n<p> </p>\n<h2>100% oryginalne Squishy!</h2>\n<p>Pianka najlepszej jakości</p>\n<p><strong>Designed in Japan</strong></p>\n<p><strong>Super pomysł na prezent !!!</strong></p>\n<p>Wysokość: 12cm</p>\n<p>Zapach: przyjemny zapach słodkości</p>\n<p>Materiał: miękka pianka spełniająca normy EN71-3</p>', '<h2>WSPANIAŁY PACHNĄCY DUŻY GNIOTEK</h2>\n<p>Ściskacz Squishy Jumbo - rewelacyjna zabawka antystresowa</p>\n<h1>KAWAII JAPAN STYLE SOWA OWL</h1>', 'squishy-ptaszek-jumbo', '', '', '', 'Squishy ptaszek jumbo', '', '', '', ''),
(15, 1, 1, '<p>KAWAII JAPAN STYLE APETYCZNY DONUT <br />Sposób na zajęcie niecierpliwych dłoni jak również świetny do ćwiczeń sensorycznych - gniotka można ugniatać na wiele sposobów. Doskonały ściskacz do rozwijania sprawności ruchowej dłoni (mała motoryka).</p>\n<p> </p>\n<p>100% oryginalne Squishy!<br />Pianka najlepszej jakości</p>\n<p>Designed in Japan</p>\n<p>Super pomysł na prezent !!!</p>', '<p>WSPANIAŁY PACHNĄCY DUŻY GNIOTEK<br />Ściskacz Squishy Jumbo - rewelacyjna zabawka antystresowa</p>', 'squishy-donut-jumbo', '', '', '', 'Squishy donut jumbo', '', '', '', ''),
(16, 1, 1, '<p>KAWAII JAPAN STYLE MIŚ<br />Sposób na zajęcie niecierpliwych dłoni jak również świetny do ćwiczeń sensorycznych - gniotka można ugniatać na wiele sposobów. Doskonały ściskacz do rozwijania sprawności ruchowej dłoni (mała motoryka).</p>\n<p> </p>\n<p>100% oryginalne Squishy!<br />Pianka najlepszej jakości</p>\n<p>Designed in Japan</p>\n<p>Super pomysł na prezent !!!</p>\n<p>Kolorowy gniotek Kawaii Smakowity Misio<br />Wysokość: 12cm</p>\n<p>Zapach: przyjemny zapach słodkości</p>\n<p>Materiał: miękka pianka spełniająca normy EN71-3</p>', '<p>WSPANIAŁY PACHNĄCY DUŻY GNIOTEK<br />Ściskacz Squishy Jumbo - rewelacyjna zabawka antystresowa</p>', 'squishy-misio-jumbo', '', '', '', 'Squishy misio jumbo', '', '', '', ''),
(17, 1, 1, '<p>KAWAII JAPAN STYLE OŚMIORNICA<br />Sposób na zajęcie niecierpliwych dłoni jak również świetny do ćwiczeń sensorycznych - gniotka można ugniatać na wiele sposobów. Doskonały ściskacz do rozwijania sprawności ruchowej dłoni (mała motoryka).</p>\n<p> </p>\n<p>100% oryginalne Squishy!<br />Pianka najlepszej jakości</p>\n<p>Designed in Japan</p>\n<p>Super pomysł na prezent !!!</p>\n<p> </p>\n<p>Kolorowy gniotek Kawaii Ośmiornica<br />Wysokość: 12cm</p>\n<p>Zapach: przyjemny zapach słodkości</p>\n<p>Materiał: miękka pianka spełniająca normy EN71-3</p>', '<p>WSPANIAŁY PACHNĄCY DUŻY GNIOTEK<br />Ściskacz Squishy Jumbo - rewelacyjna zabawka antystresowa</p>', 'jumbo-squishy-osmiorniczka', '', '', '', 'Jumbo Squishy ośmiorniczka', '', '', '', ''),
(18, 1, 1, '<p>Sposób na zajęcie niecierpliwych dłoni jak również świetny do ćwiczeń sensorycznych - gniotka można ugniatać na wiele sposobów. Doskonały ściskacz do rozwijania sprawności ruchowej dłoni (mała motoryka).</p>\n<p> </p>\n<p>100% oryginalne Squishy!<br />Pianka najlepszej jakości</p>\n<p>Designed in Japan</p>\n<p>Super pomysł na prezent !!!</p>', '<p>WSPANIAŁY PACHNĄCY DUŻY GNIOTEK<br />Ściskacz Squishy Jumbo - rewelacyjna zabawka antystresowa</p>\n<p>KAWAII JAPAN STYLE KOTEK PUSHIN</p>', 'squishy-jumbo-cat-kot', '', '', '', 'Squishy Jumbo Cat kot', '', '', '', ''),
(19, 1, 1, '', '<p>12x8cm</p>', 'squishy-pilka-football-brazowa', '', '', '', 'Squishy piłka football brązowa', '', '', '', ''),
(20, 1, 1, '', '<p>Nowość!</p>\n<p>Duże squishy XXL z brokatowymi, dużymi oczami.</p>\n<p>W \"głębokich\" oczkach brokat.</p>\n<p>szerokość: 17cm</p>\n<p>głębokość: 15cm</p>\n<p>wysokość: 11cm</p>\n<p>Rzeczywiste zdjęcia</p>', 'squishy-jumbo-rekin-z-duzymi-oczami', '', '', '', 'Squishy Jumbo Rekin z dużymi oczami', '', '', '', ''),
(21, 1, 1, '<p>Wysokość 14,5 cm</p>\n<p></p>\n<p>Szerokość 11 cm </p>', '<p>Nowość!</p>\n<p>Duże squishy z brokatowymi, dużymi oczami.</p>\n<p>W \"głębokich\" oczkach brokat.</p>\n<p>Rzeczywiste zdjęcia</p>', 'squishy-maskotka-jednorozec-z-duzymi-oczami', '', '', '', 'Squishy maskotka - jednorożec z dużymi oczami', '', '', '', ''),
(22, 1, 1, '<h2>Pluszowy Jednorożec Kawaii</h2>\n<h3>* miły w dotyku, umili czas</h3>\n<p>* odpręży, miło przelewające sie kuleczki żelowe</p>\n<p>* milutka maskotka</p>\n<p></p>\n<p>* Rewelacyjny do ćwiczenia rączki w zabawny sposób, rekomendowany również jako narzędzie do rehabilitacji.</p>\n<p>* Ćwiczy małą motorykę to doskonałe narzędzia do pracy podczas zajęć sensorycznych rozwijających małą motorykę</p>\n<p>* Dorosłym osobom pomoże odreagować stres i wyciszyć emocje. Pełni funkcję gniotka odstresowywującego.</p>\n<p></p>\n<p>Uwaga! Przeznaczone do użytku pod nadzorem dorosłego.</p>', '<p>Pluszowy gniotek antystresowy z kuleczkami ORBEEZ</p>\n<h2>jednorożec lub rekin</h2>\n<p>Rewelacyjny ściskacz z dużą ilością kuleczek ORBEEZ i brokatu.</p>\n<p>Gniotek squishy 1szt - doskonale ugniatający się. Z kuleczkami wewnątrz. Klasyczny gniotek w ciekawej oprawie. Możliwość ugniatania i zabawy. Dodatkowo maskotka !</p>', 'jellies-orbeez-squiqshy-maskotka', '', '', '', 'Jellies orbeez squiqshy maskotka', '', '', '', ''),
(23, 1, 1, '', '<p>Przesłodkie squishy.</p>\n<p>Lód misio z malinką</p>', 'squishy-lod-mis-malinka', '', '', '', 'Squishy lód miś malinka', '', '', '', ''),
(24, 1, 1, '', '<p>Gniotek w wspaniałych kolorach.</p>\n<p>Cudowna lama</p>', 'squishy-gniotek-lama', '', '', '', 'Squishy gniotek lama', '', '', '', ''),
(25, 1, 1, '<p>Rewelacyjny również dla dorosłych !!!<br />Ściskacz Squishy - rewelacyjna zabawka relaksacyjna<br />Sposób na zajęcie niecierpliwych dłoni jak również świetny do ćwiczeń sensorycznych - gniotka można ugniatać na wiele sposobów. Doskonały ściskacz do rozwijania sprawności ruchowej dłoni (mała motoryka).</p>\n<p>CYTRYNKA <br />Wysokość: ok 5cm</p>\n<p>Przyjemny zapach</p>\n<p>Materiał: pianka spełniająca normy EN71-3</p>', '<p>Kwaśna i słodka :)</p>\n<p>LIMONKA SQUISHY<br />Pięknie malowana, super pachnąca i bardzo fajna do zgniatania.</p>', 'squishy-zielona-limonka', '', '', '', 'Squishy zielona limonka', '', '', '', ''),
(26, 1, 1, '', '<p>Najsłodszy torcik</p>\n<p>Wysokość ~10cm</p>\n<p>Średnica podstawy ~10cm</p>', 'squishy-tort-jednorozec', '', '', '', 'Squishy tort jednorożec', '', '', '', ''),
(27, 1, 1, '<p>W przypadku braku wskazania kolor niespodzianka.</p>\n<p></p>\n<p>Istnieje możliwość wskazania kolorystyki dla dziewczynki lub dla chłopca.</p>', '<h1>Gniotek Wesoły Krab</h1>\n<p>Krystalicznie sylikonowy z kuleczkami orbeez.</p>\n<h2>Efekty krystaliczny.</h2>\n<p>Piękne efekty krystaliczne oraz rewelacyjna zabawa.</p>\n<p>Do wyboru kolor: różowy, niebieski, zielony, czerwony.</p>\n<p></p>', 'krab-gniotek-orbeez', '', '', '', 'Krab gniotek orbeez', '', '', '', ''),
(28, 1, 1, '', '<p>Squishy lód - misio</p>\n<p>brelok.</p>', 'squishy-misio-lod', '', '', '', 'Squishy misio lód', '', '', '', ''),
