(42, 1, 1, '<p style=\"font-family:Helvetica, Tahoma, Verdana, Arial, sans-serif;font-size:13.3333px;\">Sposób na zajęcie niecierpliwych dłoni jak również świetny do ćwiczeń sensorycznych - gniotka można ugniatać na wiele sposobów. Doskonały do rozwijania sprawności ruchowej dłoni (mała motoryka). </p>\n<h3 style=\"font-family:Helvetica, Tahoma, Verdana, Arial, sans-serif;\">Oryginalne Squishy!</h3>\n<h4 style=\"font-family:Helvetica, Tahoma, Verdana, Arial, sans-serif;\">Pianka najlepszej jakości</h4>', '<p>Ściskacz Squishy - rewelacyjna zabawka antystresowa</p>\n<p>Przyjemny, owocowy zapach</p>\n<p>Designed in Japan</p>', 'squishy-wesola-pasta-do-zebow', '', '', '', 'Squishy - Wesoła pasta do zębów', '', '', '', ''),
(43, 1, 1, '<p>Sposób na zajęcie niecierpliwych dłoni jak również świetny do ćwiczeń sensorycznych - gniotka można ugniatać na wiele sposobów.</p>\n<p></p>\n<p>Doskonały do rozwijania sprawności ruchowej dłoni (mała motoryka).</p>\n<p></p>\n<p>Oryginalne Squishy!</p>\n<p>Pianka najlepszej jakości</p>', '<p>Ściskacz Squishy - rewelacyjna zabawka antystresowa</p>\n<p>Wysokość: 15cm</p>\n<p>Przyjemny, owocowy zapach</p>\n<p>Designed in Japan</p>', 'squishy-jednorozec-bobas', '', '', '', 'Squishy Jednorożec bobas', '', '', '', ''),
(44, 1, 1, '<p>Sposób na zajęcie niecierpliwych dłoni jak również świetny do ćwiczeń sensorycznych - gniotka można ugniatać na wiele sposobów.</p>\n<p></p>\n<p>Doskonały do rozwijania sprawności ruchowej dłoni (mała motoryka).</p>\n<p></p>\n<p>Oryginalne Squishy!</p>\n<p>Pianka najlepszej jakości</p>', '<p>Ściskacz Squishy - rewelacyjna zabawka antystresowa</p>\n<p>Super miękka cytryna</p>\n<p></p>\n<p>idealnie leży w dłoni</p>\n<p>Dostępna w dwóch rozmiarach XL lub SMALL</p>\n<p></p>\n<p></p>', 'squishy-jumbo-duza-cytryna', '', '', '', 'Squishy JUMBO - Duża Cytryna', '', '', '', ''),
(45, 1, 1, '<p>Sposób na zajęcie niecierpliwych dłoni jak również świetny do ćwiczeń sensorycznych - gniotka można ugniatać na wiele sposobów.</p>\n<p></p>\n<p>Doskonały do rozwijania sprawności ruchowej dłoni (mała motoryka).</p>\n<p></p>\n<p>Oryginalne Squishy!</p>\n<p>Pianka najlepszej jakości</p>', '<p>Mniam Mniam</p>\n<p>Hamburger znany jako KotBurger</p>\n<p>Zapach hamburgera</p>\n<p>uśmiech kotka</p>\n<p>Designed in Japan</p>', 'squishy-kotburger-hamburger', '', '', '', 'Squishy KotBurger Hamburger', '', '', '', ''),
(46, 1, 1, '', '<p>Squishy Truskawka Jumbo<br />Ściskacz SquishySquishies - rewelacyjna zabawka antystresowa</p>', 'truskawka-jumbo-squishy', '', '', '', 'Truskawka JUMBO Squishy', '', '', '', ''),
(47, 1, 1, '<p>Sposób na zajęcie niecierpliwych dłoni jak również świetny do ćwiczeń sensorycznych - gniotka można ugniatać na wiele sposobów.</p>\n<p>Doskonały ściskacz do rozwijania sprawności ruchowej dłoni (mała motoryka).</p>\n<p></p>\n<p></p>\n<p></p>\n<p>Oryginalne Squishy!</p>\n<p></p>\n<p>Pianka najlepszej jakości</p>', '<p>Absolutny HIT</p>\n<p>Mleko</p>\n<p>Wysokość: 12cm</p>\n<p></p>\n<p>Zapach: przyjemny zapach mleczka</p>\n<p>Designed in Japan</p>', 'gniotek-squishy-mleko', '', '', '', 'Gniotek SQUISHY - Mleko', '', '', '', ''),
(48, 1, 1, '<p>Ściskacz Squishy Jumbo - rewelacyjna zabawka antystresowa</p>\n<p>Sposób na zajęcie niecierpliwych dłoni jak również świetny do ćwiczeń sensorycznych - gniotka można ugniatać na wiele sposobów.</p>\n<p>Doskonały ściskacz do rozwijania sprawności ruchowej dłoni (mała motoryka).</p>', '<p>Ściskacz Squishy - rewelacyjna zabawka antystresowa</p>\n<p>Ciacho - torcik</p>\n<p>Wysokość: 7cm</p>\n<p>Zapach: przyjemny zapach słodkości</p>\n<p>Designed in Japan</p>\n<p></p>', 'gniotek-tort-z-malinami', '', '', '', 'Gniotek - Tort z malinami', '', '', '', ''),
(49, 1, 1, '<h2>CUDOWNY ZAPACH !</h2>\n<p>Oferta zawiera komplet 2 sztuk butelek, każda butelka składa się z dwóch części, w kuli znajduje się szybciej rozlewający się slime galaxy. Dolna część to żelowa masa o konsystencji powoli wypływającej typu galaretka. Slime po ogrzaniu się w dłoniach staje się sprężysty.</p>\n<p>2 butelki gwarantują udaną zabawę na wiele godzin.</p>\n<p>2 butelki - fiolet i pomarańcz</p>\n<p><strong>- rzeczywiste zdjęcia -</strong></p>\n<p>Rewelacyjna opcja dla lubiących zabawy ze slime.</p>\n<p> </p>\n<p><strong>Ciekawe opakowanie umożliwia również szczelne zamknięcie. Slime nie wysycha. Można cieszyć się nim przez wiele tygodni.</strong></p>\n<p>Nowa formuła gwarantująca ciekawe doznania sensoryczne:</p>\n<p>- masa wydaje się być zimna</p>\n<p>- doskonała do ćwiczenia małej motoryki</p>\n<p>- po zamknięciu, nie wysycha</p>\n<p>- angażująca przez możliwość łączenia kolorów i cekinów</p>\n<p>- nietoksyczna CE</p>\n<p>Wysokość butelki: 14 cm</p>\n<p>POLECAMY JAKO DOSKONAŁY PREZENT ZARÓWNO DLA DZIECKA JAK I OSOBY DOROSŁEJ. REWELACYJNA DO ROZŁADOWANIA NAPIĘCIA JAK I ZABAWY. SUPER JAKO PREZENT LUB JAKO NARZĘDZIE DO REHABILITACJI.</p>', '<p>SLIME - CRYSTAL MUD</p>\n<p>Rewelacyjny Slime Pack - 2 butelki, 3 kolory, 2 rodzaje masy.</p>\n<p>W tym dwie kule wypełnione masą galaxy z cekinami.</p>', 'slime-z-kula-galaxy-masa-plastyczna', '', '', '', 'Slime z kulą GALAXY masa PLASTYCZNA', '', '', '', ''),
(50, 1, 1, '<p><strong>Rewelacyjny Slime Pack</strong> - 2 butelki i aż tyle możliwości = 2 kolory Slime, 2 kule z kolorowymi kulkami, 2 zabawki zanurzone w styropianowych kulkach.</p>\n<p>Oferta zawiera komplet 2 sztuk butelek, każda butelka składa się z dwóch części, w kuli znajdują się kolorowe posypki, kulki styropianowe w pięknych kolorach. Dolna część to masa Slime.</p>\n<p>* Krystalicznej masie trzeba pozwolić się stopniowo wylewać i przelewać gdyż jest o konsystencji streach. Zbyt szybko wyciągana zachowuje się jak galaretka i się urywa nie zaś wylewa. Do uzyskania efektu przelewania się należy ją rozgrzać w dłoniach poprzez ugniatanie. Z ugniataniem nabiera ona formy streatch.</p>\n<p>* Śliczne zapachy i piękne kolory</p>\n<p>Trzy butelki gwarantują udaną zabawę na wiele godzin.</p>\n<p>- rzeczywiste zdjęcia -</p>\n<h3>Rewelacyjna opcja dla lubiących zabawy ze slime.</h3>', '<p>SLIME - MAGIC BALL</p>\n<p>Każda kryje w sobie zabaweczki, mięciutkie Gniotki o wesołych wzorach.</p>\n<p> </p>', 'zestaw-slime-z-zabawka-squishy-masa-plastyczna', '', '', '', 'Zestaw Slime z ZABAWKĄ SQUISHY MASA PLASTYCZNA', '', '', '', ''),
(51, 1, 1, '<p>Magic Cube została wykonana z najwyższej jakości materiałów, specjalnie zaprojektowany na potrzeby kostki mechanizm magnesów pozwala na nieszablonowe, zaskakujące i niebanalne układanie oraz rozkładanie kostki.</p>\n<p> </p>\n<p>Kostka daje możliwość stworzenia ok. 72 różnych kształtów. Dodatkowym atutem zabawki jest możliwość tworzenia kształtów z kilku kostek jednocześnie.</p>\n<p>Specyfikacja:</p>\n<p>Materiał: wysokiej jakości PVC</p>\n<p>12 magnesów wewnątrz kostki</p>\n<p>Ciekawa kolorystyka</p>\n<p>Wymiary: 6cm x 6cm</p>', '<p>Kostka Magic Cube Fidget 1 szt.<br />Niezwykle kreatywna zabawa.</p>', 'kostka-magic-cube-art-changeable-magnetic', '', '', '', 'Kostka Magic Cube Art changeable magnetic', '', '', '', ''),
(52, 1, 1, '<p>Kostka bez naklejek - wykonana jest w całości z barwionego plastiku.</p>\n<p>Delikatna, pastelowa kolorystyka.</p>\n<p>Jest szybka i stabilna - idealna do nauki oraz bicia swoich rekordów.</p>\n<p>5 cm x 5 cm x 5 cm</p>\n<p>Rzeczywiste zdjęcia</p>\n<p>Kostka Rubika to popularna zabawka logiczna stworzona przez Erno Rubika w 1974 roku</p>\n<p>Idealna na dobry prezent</p>\n<p>W zestawie prosta instrukcja z algorytmami potrzebnymi do rozwiązania łamigłówki .</p>', '<p>Kostka Logiczna 2x2x2 MoYu<br />PASTEL COLORS</p>', 'kostka-logiczna-2x2x2-pastelowa-moyu', '', '', '', 'Kostka logiczna 2x2x2 pastelowa moyu', '', '', '', ''),
(53, 1, 1, '<p>WNĘTRZE PRZYPOMINA SPRĘŻYSTY SYLIKON</p>\n<p>* Ciekawa kula wypełniona żelem<br />* Nowa plastyczna formuła<br />* Piękne kolory, po ściśnięciu niebywale galaktyczne<br />* Dużaaa</p>\n<p>Gniotek doskonale ugniatający się. Wnętrze wypełnione masą niczym sylikon. Możliwość ugniatania i naciągania. Gniotka można w każdej chwili umyć pod wodą. Piękne nasycone kolory.</p>\n<p>* Rewelacyjny do ćwiczenia ręki, rekomendowany również jako narzędzie do rehabilitacji.</p>\n<p>* Ćwiczy motorykę to doskonałe narzędzia do pracy podczas zajęć sensorycznych.</p>\n<p>* Dorosłym osobom pomoże również odreagować stres i wyciszyć emocje. Pełni funkcję gniotka odstresowywującego.</p>\n<p>Uwaga! Przeznaczone do użytku pod nadzorem dorosłego.</p>\n<p> </p>\n<p>Istnieje możliwość wskazania kolorystyki chłopięcej lub dziewczęcej. W przypadku wyboru konkretnej kolorystyki prosimy o podanie koloru bezpośrednio w formularzu zakupowym w polu wiadomość dla sprzedawcy. W przypadku braku wskazania, kolor niespodzianka.</p>\n<p> </p>\n<p>Rewelacyjna sylikonowa przygoda. Idealna również do ćwiczeń wzmacniających i rehabilitacji.</p>', '<p>Magiczna kula GALAXY do rehabilitacji <br />DUŻA GALAKTYCZNA KULA SENSORYCZNA</p>', 'gniotek-sprezysta-zelowa-kula-xl-brokat-fidget', '', '', '', 'Gniotek SPRĘŻYSTA ŻELOWA kula XL brokat FIDGET', '', '', '', ''),
(54, 1, 1, '<p>BRELOK POP IT! PORTFELIK</p>\n<p><br />Rewelacyjny ozdobny brelok ANTYSTRESOWY I PAKTYCZNY. Śliczna kolorystyka. W japońskim stylu manga, kawaii. Idealny do pstrykania oraz do przechowywania drobiazgów. Wygodny do zaczepiania karabińczyk. Zawsze można go przy sobie zawiesić.</p>', '<p>Rewelacyjny brelok. Idealna praktyczna ozdoba wywołująca pozytywne emocje :) Dla osób lubiących słodkie rzeczy :)</p>', 'popit-saszetka-serce-brelok-brelok-kawaii-portfelik', '', '', '', 'Popit saszetka serce brelok BRELOK KAWAII portfelik', '', '', '', ''),
(55, 1, 1, '<p>Wesoły Jednorożec. Po naciśnięciu puszcza balony :)</p>\n<p>Gniotek Pegaz 1szt - Wykonany z gumy i po naciśnięciu puszczający balona z mięciutkiej gumy nawiązującej do gumy balonowej :)</p>\n<p>* Wesoły - idealny do rozweselania :)</p>\n<p>* Rewelacyjny do ćwiczenia rączki w zabawny sposób, rekomendowany również jako narzędzie do rehabilitacji.</p>\n<p>* Ćwiczy małą motorykę to doskonałe narzędzia do pracy podczas zajęć sensorycznych rozwijających małą motorykę</p>\n<p>* Dorosłym osobom pomoże odreagować stres i wyciszyć emocje. Pełni funkcję gniotka odstresowywującego.</p>\n<p> </p>\n<p>manga, kawaii, unicorn<br />* satynowy w dotyku, umili czas</p>\n<p>* odpręży, miło przelewający się mus plastyczny</p>\n<p>* łatwy do pielęgnacji, wystarczy umyć go pod wodą</p>\n<p>Uwaga! Przeznaczone do użytku pod nadzorem dorosłego. W przypadku wyboru koloru prosimy o podanie jego bezpośrednio w formularzu zakupowym w polu wiadomość dla sprzedawcy.</p>', '<p>Rewelacyjny gniotek antystresowy BALONOWY</p>', 'gniotek-bubble-gum-unicorn', '', '', '', 'Gniotek bubble gum unicorn', '', '', '', ''),
(56, 1, 1, '<p>Zabawka antystresowa nawiązuje do lubianej folii bąbelkowej. Można pstrykać z bąbelków w nieskończoność. Podczas tej zabawy możemy się odprężyć i rozluźnić. Dodatkowo przyciskaniu towarzyszy charakterystyczne dźwięk oraz światełka LED uaktywniające się podczas podrzucania i odciskania. Można bawić się we wciśnięcie wszystkich bąbelków i jednym ściśnięciem piłki spowodować ich odskoczenie.</p>\n<p>* pozwala poprawić koncentrację</p>\n<p>* poprawi nastrój</p>\n<p>* ćwiczy sprawność motoryczną</p>\n<p>* wygodny do trzymania panel</p>\n<p>Zabawka jest również doskonałym narzędziem do pracy podczas zajęć sensorycznych rozwijających małą motorykę, dorosłym zaś pomoże odreagować stres i wyciszyć emocje.</p>\n<p> </p>\n<p>Materiał elastyczny: Silicon</p>', '<p>Zabawka sensoryczna <br />Push Pop Bubble Fidget PIŁKA <br />REWELACYJNA PIŁECZKA HAMBURHER</p>', 'hamburger-popit', '', '', '', 'Hamburger popit', '', '', '', ''),
(57, 1, 1, '<p>można ją składać w każdym dowolnym kierunku,</p>\n<p>użytkowanie kostki daje nam satysfakcję,</p>\n<p>działa odprężająco, wyciszająco, antystresowo,</p>\n<p>super opcja, jeśli chcemy zająć czymś dzieci np. w trakcie jazdy samochodem. Wyciszy je to i uspokoi,</p>\n<p>produkt dostosowany do użytku dzieci tych młodszych jak i starszych i dorosłych,</p>', '<p>Zabawka sensoryczna Infinity Cube - kostka nieskończoności.</p>', 'infinity-cube-kostka-jednorozec', '', '', '', 'Infinity cube kostka jednorożec', '', '', '', ''),
(58, 1, 1, '<p>Wciśnij wszystkie bąbelki, wydadzą wyraźny dźwięk POP! Po ściśnięciu piłki, wszystkie na raz super odskakują!</p>\n<p>Dostępna 3 wersjach kolorystycznych do wyboru: brązowa, pastelowa i tęczowa. Kolor prosimy wskazać bezpośrednio w formularzu zakupowym, w polu wiadomość dla sprzedawcy.</p>\n<p>Zabawka jest również doskonałym narzędziem do pracy podczas zajęć z integracji sensorycznej oraz zajęć ogólnorozwojowych. Idealna zarówno dla dzieci jak i dla dorosłych.</p>\n<p>Materiał elastyczny: Silikon. Łatwa do pielęgnacji, wystarczy umyć ją wodą.</p>', '<p>Rewelacyjna PIŁKA Pop it! 1szt. Idealna do rzucania również na plażę 20cm x 11cm</p>', 'rugby-popit-pilka-plazowa-dmuchana', '', '', '', 'Rugby popit piłka plażowa dmuchana', '', '', '', ''),
(59, 1, 1, '<p>Ściśnij, puść, aby uzyskać bardzo satysfakcjonujące pop! :)</p>\n<p>Mega click!, Przyssawki</p>\n<p>Pomaga złagodzić stres i niepokój.</p>\n<p>Mała motoryka</p>\n<p>Doskonała do ćwiczenia dłoni i zrelaksowania się.</p>\n<p>Doskonałe narzędzie do pracy podczas zajęć sensorycznych rozwijających małą motorykę, dorosłym zaś pomogą odreagować stres i wyciszyć emocje.</p>\n<p>Rzeczywiste zdjęcia</p>', '<p>Fidget toy<br />Snapper<br />Zabawka antystresowa - pstrykacz</p>', 'snapper-dlon-popit-click-sensoryczny-antystresowy', '', '', '', 'Snapper dłoń popit click sensoryczny antystresowy', '', '', '', ''),
(60, 1, 1, '<p>Idealna dla małych księżniczek uwielbiających magiczne pegazy. Doskonale przyda się na letnich wyprawach jako uzupełnienie bajecznej stylizacji</p>\n<p>Wykonana z mięciutkiego i łatwego do czyszczenia silikonu. Zamykana na suwak. Dodatkową zaletą jest jej wodoodporność.</p>\n<p>Materiał elastyczny: Silikon</p>\n<p>rzeczywiste zdjęcia produktu</p>\n<p> </p>\n<p>Jednorożec fidget toy Torebeczka Saszetka<br />Wymiary:</p>\n<p>Długość torebki 11,5cm, długość całkowita wraz z uchwytami do mocowania paska to 21cm.</p>\n<p>Szerokość boku 3,3cm.</p>\n<p>Wysokość torebki to 7,5cm bez rogu, 10cm z rogiem.</p>\n<p>Wysokość Długa smycz z regulacją i zapięciem. Maksymalna długość paska to 62cm z możliwością regulacji do 44cm (obwód pasa).</p>\n<p>Nerka sprzedawana bez błyszczyka ukazującego rozmiar saszetki.</p>', '<p>Torebka typu, nerka na pas.<br />Motyw: Piękny Jednorożec z zamkniętymi oczyma. <br />Rewelacyjna saszetka idealna na najpotrzebniejsze drobiazgi.</p>', 'torebka-nerka-jednorozec-fidget-rozowa', '', '', '', 'Torebka nerka jednorożec fidget różowa', '', '', '', ''),
(61, 1, 1, '<p>Idealny dla każdego również jako narzędzie do pracy przy wyrabianiu zręczności i precyzyjności.</p>\n<p> </p>\n<p>Zabawki antystresowe to również doskonałe narzędzia do pracy podczas zajęć integracji sensorycznej, rozwijających małą motorykę. Dorosłym pomogą odreagować stres i wyciszyć emocje. Polecane również jako pomoce rehabilitacyjne.</p>\n<p> </p>\n<p>W przypadku braku wskazania we wiadomości dla sprzedającego koloru breloka: kolory pastelowe lub kolory nasycone - bezpośrednio w formularzu zakupowym \"pole wiadomość dla sprzedawcy\" - kolor niespodzianka, zawsze pięknie kolorowy widoczny na zdjęciach.</p>\n<p>Istnieje możliwość wskazania opcji kolorystycznej: zestaw dla dziewczynki lub zestaw dla chłopca.</p>', '<p>Metalowe pierścienie - Flippy Chain Fidget Toy 1szt. Idealny kieszonkowy gadżet antystresowy. Pierścienie można przekładać między sobą.</p>', 'flippy-chain-metalowe-ringi-fidget-toys', '', '', '', 'Flippy Chain METALOWE RINGI Fidget Toys', '', '', '', ''),
(62, 1, 1, '<p>można ją składać w każdym dowolnym kierunku,</p>\n<p>użytkowanie kostki daje nam satysfakcję,</p>\n<p>działa odprężająco, wyciszająco, antystresowo,</p>\n<p>super opcja, jeśli chcemy zająć czymś dzieci np. w trakcie jazdy samochodem. Wyciszy je to i uspokoi,</p>\n<p>produkt dostosowany do użytku dzieci tych młodszych jak i starszych i dorosłych,</p>', '<p>Zabawka sensoryczna Infinity Cube - kostka nieskończoności.</p>', 'infinity-cube-kostka-galaxy', '', '', '', 'Infinity cube kostka galaxy', '', '', '', ''),
(63, 1, 1, '', '<p>Gniotek gigant</p>\n<p>Satisfying GooZooka Squeezers Squishy Bouncy Ball</p>\n<p>Losowa Kolorystyka. Satysfakcja gwarantowana!</p>', 'gniotek-xxxl-goozooka-jumbo', '', '', '', 'Gniotek XXXL goozooka JUMBO', '', '', '', ''),
(64, 1, 1, '<p>Zabawki sensoryczne zestaw 2 bransoletek - miłe w dotyku i ładnie pachnące. Pudrowe.<br />BRANSOLETKI 2 SZT JEDNOROŻCE</p>\n<p><br />Zabawki są również doskonałymi narzędziami do pracy podczas zajęć sensorycznych rozwijających małą motorykę, dorosłym zaś pomogą odreagować stres i wyciszyć emocje. Wyjątkowo miły gadżet :)</p>\n<p># Narzędzie do zajęć z integracji sensorycznej</p>\n<p># Zabawka również idealna dla dorosłych</p>\n<p>Materiał elastyczny: Silicon</p>', '<p>Dziewczęcy Fidget Toy. Zestaw dwóch cudownych sensorycznych bransoletek.</p>', 'bransoletki-sensoryczne-jednorozec-2-szt', '', '', '', 'Bransoletki sensoryczne jednorożec 2 szt', '', '', '', ''),
(65, 1, 1, '<p>----</p>\n<p>Rewelacyjna zabawka antystresowa. <br />----</p>\n<p>Możliwość ugniatania i naciągania. Rewelacyjny do ćwiczenia małej motoryki. Polecany jako narzędzie do rehabilitacji. Sprawdza się przy ćwiczeniach IS</p>\n<p>* Rewelacyjny do poznawania przez dotyk. Bardzo miły i ciekawy w dotyku.</p>\n<p>* Ćwiczy małą motorykę to doskonałe narzędzia do pracy podczas zajęć sensorycznych rozwijających małą motorykę</p>\n<p>* Dorosłym osobom pomoże odreagować stres i wyciszyć emocje. Pełni funkcję gniotka odstresowywującego.</p>\n<p>Pastelowy stworek<br />* bardzo przyjemny w dotyku</p>\n<p>* polecany jako zabawka do rehabilitacji</p>\n<p>* sprężysty można nim się bawić jak yoyo</p>\n<p>* po wstrząśnięciu świeci</p>\n<p>* łatwy do pielęgnacji, wystarczy umyć go pod wodą</p>\n<p>Dostępne kolory pastelowe: róż, mięta, błękit, fiolet i zielony. W przypadku braku wskazania wersji kolorystycznej dla chłopca lub dziewczynki, w formularzu zakupowym, kolor niespodzianka.</p>', '<p>Kulka sensoryczna z wypustkami Covidek</p>', 'gniotek-led-pastelowy-stworek-covidek', '', '', '', 'Gniotek LED Pastelowy stworek Covidek', '', '', '', ''),
(66, 1, 1, '', '', 'gniotek-grzybek', '', '', '', 'Gniotek grzybek', '', '', '', ''),
(67, 1, 1, '<p>Dodatkowo, można obierać ją ze skórki :)</p>\n<p>Rewelacyjny ściskacz z dużą ilością kuleczek ORBEEZ</p>\n<p>Gniotek squishy 1szt - doskonale ugniatający się. Z kuleczkami wewnątrz. Klasyczny gniotek w ciekawej oprawie. Możliwość ugniatania i naciągania.</p>\n<p>* Rewelacyjny do ćwiczenia rączki w zabawny sposób, rekomendowany również jako narzędzie do rehabilitacji.</p>\n<p>* Ćwiczy małą motorykę to doskonałe narzędzia do pracy podczas zajęć sensorycznych rozwijających małą motorykę</p>\n<p>* Dorosłym osobom pomoże odreagować stres i wyciszyć emocje. Pełni funkcję gniotka odstresowywującego.</p>\n<p>Uwaga! Przeznaczone do użytku pod nadzorem dorosłego.</p>\n<p> </p>\n<p>Wesoły Owocek<br />* miły w dotyku, umili czas</p>\n<p>* odpręży, miło przelewające sie kuleczki żelowe</p>\n<p>* łatwy do pielęgnacji, wystarczy umyć go pod wodą</p>', '<p>MANDARYNKA OWOC gniotek antystresowy z kuleczkami ORBEEZ</p>', 'gniotek-antystresowy-mandarynka-fidget-toy', '', '', '', 'Gniotek antystresowy mandarynka Fidget toy', '', '', '', ''),
(68, 1, 1, '<p>Spiderman w trzech wersjach kolorystycznych do wyboru: czarny, mint, fiolet. Kolor prosimy wskazać bezpośrednio w formularzu zakupowym, w polu wiadomość dla sprzedawcy.</p>\n<p>Zabawka antystresowa nawiązuje do lubianej folii bąbelkowej. Można pstrykać z bąbelków w nieskończoność. Podczas tej zabawy możemy się odprężyć i rozluźnić. Dodatkowo przyciskaniu towarzyszy charakterystyczne dźwięk POP.</p>\n<p>Zabawka jest również doskonałym narzędziem do pracy podczas zajęć sensorycznych rozwijających małą motorykę dorosłym zaś pomoże odreagować stres i wyciszyć emocje.</p>\n<p>Materiał elastyczny: Silikon</p>\n<p>rzeczywiste zdjęcia produktu</p>', '<p>Rewelacyjny Pop it! 1szt.<br />Wciśnij wszystkie bąbelki, wydadzą wyraźny dźwięk POP!</p>', 'pop-it-spiderman', '', '', '', 'Pop it spiderman', '', '', '', ''),
(69, 1, 1, '<p>DOSKONAŁA PLASTELINA, KTÓRA NIE BRUDZI I JEST NADZWYCZAJNIE MIŁA W DOTYKU.</p>\n<p> </p>\n<p>NOWA FORMUŁA GWARANTUJE DOSKONAŁĄ SENSORYCZNĄ PRZYGODĘ. MASA JEST BARDZO PLASTYCZNA I MOŻE ZASTĄPIĆ RÓWNIEŻ GLINKĘ. PO POZOSTAWIENIU JEJ NA DŁUŻEJ BEZ ZAMKNIĘCIA - KSZTAŁT ZASTYGA NA STAŁE TWORZĄC CIEKAWE PIANKOWE DZIEŁA.</p>\n<p> </p>\n<p>PO ULEPIENIU TA LEKKA MASA - ODBIJA SIĘ NICZYM PIŁKA. JEST BARDZO ZASKAKUJĄCA. MOŻNA JĄ MIESZAĆ ZE SOBĄ TWORZĄC RÓŻO BARWNE DZIEŁA.</p>\n<p> </p>\n<p>ZAMKNIĘTA SZCZELNIE - NIE WYSYCHA I MOŻNA NIĄ SIĘ BAWIĆ BARDZO DŁUGO JAK NA TEGO TYPU MASY.</p>\n<p>Rewelacyjna opcja dla lubiących zabawy sensoryczne.</p>\n<p> </p>\n<p>Nowa formuła gwarantująca ciekawe doznania sensoryczne:</p>\n<p>Rewelacyjny slime W NOWEJ FORMULE.</p>\n<p>Masa sensoryczna</p>\n<p>- lekka pianka</p>\n<p>- doskonała do ćwiczenia małej motoryki</p>\n<p>- po zamknięciu, nie wysycha</p>\n<p>- nietoksyczna CE</p>\n<p>- nie brudząca</p>\n<p> </p>\n<p>POLECAMY JAKO DOSKONAŁY PREZENT ZARÓWNO DLA DZIECKA JAK I OSOBY DOROSŁEJ. REWELACYJNA DO ROZŁADOWANIA NAPIĘCIA JAK I ZABAWY. SUPER JAKO PREZENT LUB JAKO NARZĘDZIE DO REHABILITACJI.</p>\n<p> </p>\n<p>SPECYFIKACJA:</p>\n<p>- masa ze względu na swoją specyfikę jest lekka</p>\n<p>- objętość 1 paczuszki to ok 5cm x 6cm</p>\n<p>- komplet składa się z 36 paczuszek</p>', '<p>MAGIC CLAY FLUFFY PUFFY</p>\n<p>Magiczna Piankolina 36 sztuk</p>\n<p>Ogromna ilość kolorów</p>', 'piankolina-36-kolorow-masa-plastyczna', '', '', '', 'Piankolina 36 kolorów masa plastyczna', '', '', '', ''),
(70, 1, 1, '<p>Huggy Wuggy w 2 wersjach kolorystycznych do wyboru: czarny, mint, fiolet. Kolor prosimy wskazać bezpośrednio w formularzu zakupowym, w polu wiadomość dla sprzedawcy.<br />-----</p>\n<p>Zabawka antystresowa nawiązuje do lubianej folii bąbelkowej. Można pstrykać z bąbelków w nieskończoność. Podczas tej zabawy możemy się odprężyć i rozluźnić. Dodatkowo przyciskaniu towarzyszy charakterystyczne dźwięk POP.</p>\n<p>-----</p>\n<p>Zabawka jest również doskonałym narzędziem do pracy podczas zajęć sensorycznych rozwijających małą motorykę dorosłym zaś pomoże odreagować stres i wyciszyć emocje.</p>\n<p>Materiał elastyczny: Silikon</p>\n<p>rzeczywiste zdjęcia produktu</p>', '<p>Popit huggy wuggy</p>\n<p>15x11 cm</p>\n<p>Wciśnij wszystkie bąbelki, wydadzą wyraźny dźwięk POP!</p>', 'huggy-wuggy-popit-push-bubble-fidget', '', '', '', 'Huggy Wuggy Popit Push Bubble Fidget', '', '', '', ''),
(71, 1, 1, '<p>Kostka bez naklejek - wykonana jest w całości z barwionego plastiku.</p>\n<p>Delikatna, pastelowa kolorystyka.</p>\n<p>Jest szybka i stabilna - idealna do nauki oraz bicia swoich rekordów.</p>\n<p>Rozmiar: 57 mm</p>\n<p>Rzeczywiste zdjęcia</p>\n<p>Kostka Rubika to popularna zabawka logiczna stworzona przez Erno Rubika w 1974 roku</p>\n<p>Idealna na dobry prezent<br />W zestawie prosta instrukcja z prostymi algorytmami.</p>\n<p> </p>\n<p>Pod center capami są śrubki regulacyjne. Można ustawić kostkę według własnych preferencji.</p>\n<p>Lekka, Wysokiej jakości tworzywo</p>', '<p>Kostka Logiczna 3x3x3 MoYu MEI LONG<br />PASTEL COLORS</p>', 'kostka-3x3x3-pastelowa-moyu', '', '', '', 'Kostka 3x3x3 pastelowa MoYu', '', '', '', ''),
(72, 1, 1, '<p>Maskotka Ośmiorniczka Octupus - dwustronna</p>\n<p>__________________________________________________<br />Maskotka Octopus - doskonały pomysł na określanie i wyrażanie emocji. To również sprytny pretekst do rozmowy o nich. Dwukolorowa, dwustronna i mięciutka.</p>\n<p> </p>', '<p>Huggy Wuggy - osmiornica<br />POPPY PLAYTIME</p>', 'huggy-wuggy-dwustronna-osmiornica-poppy-playtime', '', '', '', 'Huggy Wuggy dwustronna ośmiornica POPPY PLAYTIME', '', '', '', ''),
(73, 1, 1, '<p>Ulubiona postać z japońskiej bajki w wersji kieszonkowej zabawki.</p>\n<p>Gniotek squishy 1szt - doskonale ugniatający się. Wewnątrz wypełniony pianką plastyczną. Klasyczny gniotek w ciekawej oprawie. Możliwość ugniatania i naciągania.</p>\n<p>* Rewelacyjny do ćwiczenia rączki w zabawny sposób, rekomendowany również jako narzędzie do rehabilitacji.</p>\n<p>* Ćwiczy małą motorykę to doskonałe narzędzia do pracy podczas zajęć sensorycznych rozwijających małą motorykę</p>\n<p>* Dorosłym osobom pomoże odreagować stres i wyciszyć emocje. Pełni funkcję gniotka odstresowywującego.</p>\n<p>Uwaga! Przeznaczone do użytku pod nadzorem dorosłego.</p>', '<p>Rewelacyjny gniotek antystresowy z musem plastycznym wewnątrz.</p>', 'gniotek-antystresowy-pikachu-fidget-toy', '', '', '', 'Gniotek antystresowy Pikachu fidget toy', '', '', '', ''),
(74, 1, 1, '<p>Magiczny Jednorożec.<br />----</p>\n<p>Gniotek squishy 1szt - doskonale ugniatający się. Wewnątrz wypełniony pianką plastyczną. Klasyczny gniotek w ciekawej oprawie. Możliwość ugniatania i naciągania.</p>\n<p>* Rewelacyjny do ćwiczenia rączki w zabawny sposób, rekomendowany również jako narzędzie do rehabilitacji.</p>\n<p>* Ćwiczy małą motorykę to doskonałe narzędzia do pracy podczas zajęć sensorycznych rozwijających małą motorykę</p>\n<p>* Dorosłym osobom pomoże odreagować stres i wyciszyć emocje. Pełni funkcję gniotka odstresowywującego.</p>\n<p>----</p>\n<p>Uwaga! Przeznaczone do użytku pod nadzorem dorosłego.</p>', '<p>Rewelacyjny gniotek antystresowy z musem plastycznym wewnątrz.</p>', 'gniotek-jednorozec-kawaii-manga-fidget-toy', '', '', '', 'Gniotek jednorożec KAWAII MANGA fidget toy', '', '', '', ''),
