(77, 1, 1, '<p>13,5 x 22 cm</p>', '<p>Fidget Toy Baby Yoda From Star Wars,</p>\n<p>Sensory Bubble Pop</p>', 'popit-zabawka-gra-sensoryczna-yoda', '', '', '', 'Popit zabawka gra sensoryczna Yoda', '', '', '', ''),
