(79, 1, 1, '<p>Idealna także na dobry prezent</p>\n<p>W oryginalnym opakowaniu znajduje się prosta instrukcja</p>\n<p>Jak każda kostka od ShengShou doskonale \"tnie\" boki.</p>\n<p>Polecamy, to najlepszy mirror</p>', '<h2>Oryginalna Kostka 3x3x3 </h2>\n<p>black silver</p>\n<h3>Mirror od ShengShou</h3>\n<p>Doskonała kostka - nasmarowana, doskonale spasowana, w ogóle się nie zacina dzięki czemu jest przyjemność z układania.</p>\n<p>Są śrubki regulacyjne. Można ustawić kostkę według własnych preferencji.</p>\n<p>Idealnie wyważona, wysokiej jakości tworzywo, piękny srebrny kolor</p>\n<p>Rzeczywiste zdjęcia</p>', 'kostka-logiczna-mirror-silver', '', '', '', 'Kostka logiczna Mirror silver', '', '', '', ''),
(80, 1, 1, '<p>Wymiary:</p>\n<p>11,5 x 4,2 cm</p>\n<p>Kukurydza<br />* miły w dotyku, umili czas</p>\n<p>* odpręży, miło przelewające sie kuleczki żelowe</p>\n<p>* łatwy do pielęgnacji, wystarczy umyć go pod wodą</p>\n<p>Rewelacyjny ściskacz o ciekawym wyglądzie.<br />----</p>\n<p>Gniotek squishy 1szt - doskonale ugniatający się. Wewnątrz wypełniony pianką plastyczną. Klasyczny gniotek w ciekawej oprawie. Możliwość ugniatania i naciągania.</p>\n<p>* Rewelacyjny do ćwiczenia rączki w zabawny sposób, rekomendowany również jako narzędzie do rehabilitacji.</p>\n<p>* Ćwiczy małą motorykę to doskonałe narzędzia do pracy podczas zajęć sensorycznych rozwijających małą motorykę</p>\n<p>* Dorosłym osobom pomoże odreagować stres i wyciszyć emocje. Pełni funkcję gniotka odstresowywującego.</p>\n<p>----</p>\n<p>Uwaga! Przeznaczone do użytku pod nadzorem dorosłego.</p>\n<p> </p>', '<p>REWELACYJNA KUKURYDZA<br />gniotek antystresowy musem plastycznym wewnątrz.</p>', 'kukurydza-gniotek-antystresowy-fidget', '', '', '', 'Kukurydza gniotek antystresowy Fidget', '', '', '', ''),
(81, 1, 1, '', '<p>Gniotek antystresowy typu orbeez.</p>\n<p>Idealny dla chłopaka.</p>\n<p>Drapieżny, straszny :)</p>', 'gniotek-wilkolak-czarny-fidget-toy', '', '', '', 'Gniotek wilkołak czarny fidget toy', '', '', '', ''),
