(88, 1, 1, '', '<p>Krokodyl potrafi ugryźć.</p>\n<p>Tęczowa zabawka antystresowa pop it.</p>', 'popit-teczowy-krokodyl', '', '', '', 'Popit tęczowy krokodyl', '', '', '', ''),
(89, 1, 1, '', '<p>Popit w kształcie wieloryba.</p>\n<p>Zabawka antystresowa</p>\n<p>17 x 21 x 1,5 cm</p>', 'popit-ryba-wieloryb', '', '', '', 'Popit ryba wieloryb', '', '', '', ''),
(90, 1, 1, '<p><br />Pojemny piórnik antystresowy :) Wciśnij wszystkie bąbelki, wydadzą wyraźny dźwięk POP! Noś ze sobą wszystkie potrzebne rzeczy i umilaj sobie czas :)</p>\n<p>Jednorożec fidget toy Torebeczka Saszetka</p>\n<p>Wyjątkowo pojemny. Łatwy do pielęgnacji. Piękny estetyczny jednorożec. Przepiękne kolory. Ramionko z regulacją.</p>\n<p>Materiał elastyczny: Silikon</p>\n<p>rzeczywiste zdjęcia produktu</p>\n<p> </p>\n<p>Długa smycz z regulacją.</p>\n<p>Materiał elastyczny: Silikon</p>\n<p>rzeczywiste zdjęcia produktu</p>', '<p>Zestaw zabawek sensorycznych<br />Torebka, portfelik Piórnik Pop it! + akcesoria<br />1 gniotek unicorn + 1 gniotek tęczowa kula</p>', 'zestaw-fidget-toys-torebka-jednorozec-popit', '', '', '', 'Zestaw fidget toys torebka jednorożec popit', '', '', '', ''),
(91, 1, 1, '<p>Rewelacyjny ściskacz z dużą ilością plastycznego piasku<br />----</p>\n<p>Możliwość ugniatania i naciągania. Rewelacyjny do ćwiczenia małej motoryki. Polecany jako narzędzie do rehabilitacji. Sprawdza się przy ćwiczeniach IS</p>\n<p>* Rewelacyjny do ćwiczenia rączki w zabawny sposób, rekomendowany również jako narzędzie do rehabilitacji.</p>\n<p>* Ćwiczy małą motorykę to doskonałe narzędzia do pracy podczas zajęć sensorycznych rozwijających małą motorykę</p>\n<p>* Dorosłym osobom starszych pomoże odreagować stres i wyciszyć emocje. Pełni funkcję gniotka odstresowywującego.</p>\n<p>----</p>\n<p>Uwaga! Przeznaczone do użytku pod nadzorem dorosłego.</p>\n<p> </p>\n<p>Plastyczny Piesek Ananasek<br />* bardzo plastyczny</p>\n<p>* polecany jako zabawka do rehabilitacji</p>\n<p>* łatwy do pielęgnacji, wystarczy umyć go pod wodą</p>\n<p>W przypadku braku wskazania koloru, kolor niespodzianka. Istnieje możliwość wskazania kolorystyki dla chłopca lub dla dziewczynki.</p>', '<p>Pies gniotek antystresowy z talkiem</p>', 'gniotek-zabawka-sensoryczna-pies', '', '', '', 'Gniotek ZABAWKA SENSORYCZNA pies', '', '', '', ''),
(92, 1, 1, '<h2>Mystery BOX to doskonały pomysł na prezent! <br />Idealny dla dzieci, młodzieży. Zabawne gadżety ucieszą również dorosłych.</h2>\n<p> </p>\n<p>SquishySquishies istnieje od 2015 roku, specjalizuje się w sprzedaży zabawek sensorycznych, squishy, gniotków, mas plastycznych typu slime i wielu inny zabawek kreatywnych.</p>\n<h2>Zawartość opakowania: 10 fidgetów.</h2>\n<p>Zabawki to również doskonałe narzędzia do pracy podczas zajęć sensorycznych rozwijających małą motorykę, dorosłym zaś pomogą odreagować stres i wyciszyć emocje.</p>\n<p> </p>\n<p>Simple dimple, Simple dimple breloczki, POP IT - push bubble, POP IT breloczki, wężyki twister, kolorowe kule logiczne, gniotki mochi squishy, opaski pop it, kostki antystresowe infinity, kostki sensoryczne, gniotki squishy, kule sensoryczne z kulkami orbeez, pop tubes, Snappery, Sticky gniotki, noodle stretch strings MONKEY NOODLE, Simple dimple spinnery, antystresowe pierścienie magnetyczne, długopisy fidget, fistaszki, fasolki, wiewiórki .... :)</p>', '<p>zestaw 10 szt. gadżetów antystresowych</p>\n<p>Do wyboru trzy wersje specjalnie wyselekcjonowane:</p>\n<p>- dla dziewczyny <br />- dla chłopaka<br />- miks dla chłopaka i dla dziewczyny</p>', 'mystery-box-fidget-toys', '', '', '', 'Mystery BOX Fidget toys', '', '', '', ''),
(93, 1, 1, '<p>- działa antystresowo i odstresowująco</p>\n<p>- dla dzieci i dorosłych</p>\n<p>- terapia sensoryczna</p>\n<p>- pomoc w ćwiczeniu uścisku, palców</p>\n<p>- zabawny bananek :)</p>', '<p>Brelok banan z buźkami</p>', 'fidget-toys-banan-zabawka-sensoryczna', '', '', '', 'Fidget toys banan zabawka sensoryczna', '', '', '', ''),
(94, 1, 1, '<p>* Wypełniony piankową masą<br />* Nowa plastyczna formuła<br />* Dodatkowe doznania sensoryczne dzięki płynnej konsystencji wewnątrz</p>\n<p>Doskonale ugniatająca się kanapeczka :). Wnętrze wypełnione masą piankową. Można ją ugniatać i ugniatać :). Klasyczne gniotki w nowatorskiej formule - piankolina niczym budyń w sylikonowej bańce. Możliwość ugniatania i naciągania. Gniotka można w każdej chwili umyć pod wodą.</p>\n<p> </p>\n<p>* Rewelacyjny do ćwiczenia rączki w zabawny sposób, rekomendowany również jako narzędzie do rehabilitacji.<br />* Ćwiczy małą motorykę to doskonałe narzędzia do pracy podczas zajęć sensorycznych rozwijających małą motorykę<br />* Dorosłym osobom pomoże odreagować stres i wyciszyć emocje. Pełni funkcję gniotka odstresowywującego.<br />* Pomocny w ćwiczeniu skupienia uwagi np. podczas zajęć.<br />----</p>\n<p>Istnieje możliwość wskazania koloru w formularzu zakupowym w polu wiadomość dla sprzedającego.</p>\n<p>Uwaga! Przeznaczone do użytku pod nadzorem dorosłego.</p>', '<p>Rewelacyjny gniotek <br />Hamburger Kanapka<br />Wyjątkowo ciekawy i wesoły gniotek piankowy.</p>\n<p>Delikatny a zarazem sprężysty w dotyku.</p>', 'gniotek-hamburger', '', '', '', 'Gniotek hamburger', '', '', '', '');
INSERT INTO `ps_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(95, 1, 1, '<p>Delikatny a zarazem sprężysty w dotyku.</p>\n<p>Wypełniony piankową masą. </p>\n<p>Nowa plastyczna formuła. </p>\n<p></p>\n<p>Dodatkowe doznania sensoryczne dzięki wypustkom.</p>\n<p></p>\n<p>Doskonale ugniatające się durian.  Wnętrze wypełnione masą piankową.</p>\n<p>Można ją ugniatać i ugniatać :). Klasyczne gniotki w nowatorskiej formule - pianka slime w sylikonowej bańce.</p>\n<p>Możliwość ugniatania i naciągania.</p>\n<h3>Gniotka można w każdej chwili umyć pod wodą.</h3>\n<p><strong>Kolor zielony, cytrynowy lub pomarańczowy.</strong></p>\n<h2>* Rewelacyjny do ćwiczenia rączki w zabawny sposób, rekomendowany również jako narzędzie do rehabilitacji.</h2>\n<p>* Ćwiczy małą motorykę to doskonałe narzędzia do pracy podczas zajęć sensorycznych rozwijających małą motorykę</p>\n<p>* Dorosłym osobom pomoże odreagować stres i wyciszyć emocje. Pełni funkcję gniotka odstresowywującego.</p>\n<p>* Pomocny w ćwiczeniu skupienia uwagi np. podczas zajęć.</p>\n<p></p>\n<p>Istnieje możliwość wskazania koloru w formularzu zakupowym w polu wiadomość dla sprzedającego.</p>\n<p></p>\n<p><strong>Uwaga! Przeznaczone do użytku pod nadzorem dorosłego.</strong></p>', '<p>Gniotek Zakazany Owoc </p>\n<p>DURIAN</p>\n<h2>Wyjątkowo ciekawy gniotek piankowy.</h2>\n<p></p>', 'gniotek-z-pianke-durian-owoc-4-szt', '', '', '', 'Gniotek z piankę durian owoc 4 szt.', '', '', '', ''),
(96, 1, 1, '', '<p>Ośmiornica Galaxy</p>\n<p>Maskotka Ośmiorniczka Octupus - dwustronna</p>\n<p>Maskotka Octopus - <strong>doskonały pomysł na określanie i wyrażanie emocji.</strong> To również sprytny pretekst do rozmowy o nich. <strong>Dwukolorowa</strong>, <strong>dwustronna</strong> i mięciutka. Pięknie zdobiona w cudownych kolorach.</p>', 'osmiornica-dwustronna-galaxy-gwiazdki', '', '', '', 'Ośmiornica dwustronna galaxy gwiazdki', '', '', '', ''),
(97, 1, 1, '<p>* Ciekawe kule wypełnione piankową masą jak budyń<br />* Nowa plastyczna formuła<br />* Gniotki antystresowe aksamitne w dotyku i pięknie pachnące<br />----</p>\n<p>Gniotki - doskonale ugniatające się. Wnętrze wypełnione masą piankową. Klasyczne gniotki w nowatorskiej formule - pianka slime w sylikonowej bańce. Możliwość ugniatania i naciągania. Gniotka można w każdej chwili umyć pod wodą.</p>\n<p>* Rewelacyjny do ćwiczenia rączki w zabawny sposób, rekomendowany również jako narzędzie do rehabilitacji.</p>\n<p>* Ćwiczy małą motorykę to doskonałe narzędzia do pracy podczas zajęć sensorycznych rozwijających małą motorykę</p>\n<p>* Dorosłym osobom starszym pomoże odreagować stres i wyciszyć emocje. Pełni funkcję gniotka odstresowywującego. Zdecydowanie rozwesela!</p>\n<p>----</p>\n<p>Uwaga! Przeznaczone do użytku pod nadzorem dorosłego.</p>', '<p>Magiczne kule ZWIERZACZKI antystresowe<br />w 6 kolorach Z MORDECZKAMI ( fiolet, róż, pomarańcz, biały, brązowy, rudy, niebieski)</p>', 'gniotki-kolorowe-stworki', '', '', '', 'Gniotki kolorowe stworki', '', '', '', ''),
(98, 1, 1, '<p>SURPRISE - TOREBKA - PEŁNA SKARBÓW<br />_ _ _ _ _</p>\n<p>KREATYWNY BOX ZAWIERA W SOBIE REWELACYJNE ZABAWKI IDEALNE DLA DZIEWCZYNKI LUBIĄCEJ BAJECZNE PEGAZY. TOREBKA IDEALNA JEST JAKO PREZENT Z NAJWAŻNIEJSZYMI GADŻETAMI :)</p>\n<p>Kreatywny box zawiera w sobie cudowne zabawki i dodatki idealne dla dziewczynki. W torebce, którą można zabrać ze sobą znajdzie się również cudowna spinka do włosów w stylu magicznego jednorożca. Dziewczynka znajdzie w niej również kosmetyk, pamiętniczek oraz rewelacyjną grę zręcznościową. Na koniec można pobawić się rewelacyjnie pachnącym - slimem z figurką wewnątrz słoiczka. Do tego, niezawodny fidget toy - tęczowy unickorn.</p>\n<p>_____</p>\n<p>IDEALNY POMYSŁ NA KREATYWNY I FUNKCJONALNY PREZENT</p>\n<p> </p>\n<p>Skład zestawu:</p>\n<p>- PRZEPIĘKNA TOREBKA JEDNOROŻEC</p>\n<p>- 1 SLIME CRYSTAL Z FIGURKĄ KONIKA</p>\n<p>- 1 FIDGET TOY - POP IT TĘCZOWY JEDNOROŻEC</p>\n<p>- 1 PRZEPIĘKNA SPINKA DO WŁOSÓW</p>\n<p>- 1 SEKRETNIK NIESPODZIANKA</p>\n<p>- 1 GRA ZRĘCZNOŚCIOWA Z UNICORNEM</p>\n<p> </p>\n<p>#SUPER NA PREZENT<br />Edycja limitowana, rzeczywiste zdjęcia</p>\n<p> </p>\n<p># PRZEPIĘKNA TOREBKA UNICORN - HOLOGRAFICZNA I PIĘKNIE MIENIĄCA SIĘ. MOŻLIWOŚĆ REGULACJI PASECZKA (MOŻE BYĆ KRÓTSZA I DŁUŻSZA)<br />W ZESTAWIE ZNAJDUJĄ SIĘ JEDNA SPOŚRÓD PREZENTOWANYCH NA ZDJĘCIU.</p>', '<p>ZESTAW PREZENTOWY - PEŁEN WRAŻEŃ<br />Kreatywny zestaw - DIY - JEDNOROŻEC // PEGAZ</p>', 'box-jednorozec-z-torebka-unicorn', '', '', '', 'Box jednorożec z torebką unicorn', '', '', '', ''),
(99, 1, 1, '<p>Zabawka antystresowa nawiązuje do lubianej folii bąbelkowej. Można pstrykać z bąbelków w nieskończoność. Podczas tej zabawy możemy się odprężyć i rozluźnić. Dodatkowo przyciskaniu towarzyszy charakterystyczne dźwięk POP.</p>\n<p>-----</p>\n<p>Zabawka jest również doskonałym narzędziem do pracy podczas zajęć sensorycznych rozwijających małą motorykę dorosłym zaś pomoże odreagować stres i wyciszyć emocje.</p>\n<p>Materiał elastyczny: Silikon</p>\n<p>rzeczywiste zdjęcia produktu</p>', '<p>Pop it!<br />Wciśnij wszystkie bąbelki, wydadzą wyraźny dźwięk POP!</p>\n<p>Smakowite AWOKADO fidget toy</p>\n<p>17x12cm</p>', 'popit-avocado-kawaii-antystresowe-awokado', '', '', '', 'Popit avocado kawaii ANTYSTRESOWE AWOKADO', '', '', '', ''),
(100, 1, 1, '', '<p><strong>Kule sensoryczne</strong> w ciekawej formie ciasta. Idealne do gniecenia. W środku pianka.</p>\n<p>Komplet 4 sztuk.</p>', 'kule-sensoryczne-kulka-ciasto-4-szt', '', '', '', 'Kule sensoryczne kulka ciasto 4 szt', '', '', '', ''),
(101, 1, 1, '<p></p>\n<p>Rewelacyjny ściskacz z dużą ilością kuleczek ORBEEZ</p>\n<p>Gniotek squishy 1szt - doskonale ugniatający się. Z kuleczkami wewnątrz. Klasyczny gniotek w ciekawej oprawie. Możliwość ugniatania i naciągania.</p>\n<p>* Rewelacyjny do ćwiczenia rączki w zabawny sposób, rekomendowany również jako narzędzie do rehabilitacji.</p>\n<p>* Ćwiczy małą motorykę to doskonałe narzędzia do pracy podczas zajęć sensorycznych rozwijających małą motorykę</p>\n<p>* Dorosłym osobom pomoże odreagować stres i wyciszyć emocje. Pełni funkcję gniotka odstresowywującego.</p>\n<p>Uwaga! Przeznaczone do użytku pod nadzorem dorosłego.</p>', '<p>WINOGRONO gniotek antystresowy z kuleczkami ORBEEZ</p>\n<p>Wesoły Owocek</p>\n<p>* miły w dotyku, umili czas</p>\n<p>* odpręży, miło przelewające sie kuleczki żelowe</p>\n<p>* łatwy do pielęgnacji, wystarczy umyć go pod wodą</p>', 'gniotek-orbeez-winogrono', '', '', '', 'Gniotek orbeez winogrono', '', '', '', ''),
(102, 1, 1, '<p>Magiczna kula AKSAMIT gniotki antystresowe</p><p>DUŻA KOLOROWA KULA SENSORYCZNA</p><p>kula kryje w sobie piankę mięciutką niczym mus</p><p><br /></p><p>* Ciekawa kula wypełniona piankową masą</p><p>* Nowa plastyczna formuła</p><p>* Piękne kolory, po ściśnięciu widać kolejne kolory !!!</p><p>* Dużaaa</p><p><br /></p><p>Gniotek doskonale ugniatający się.  Wnętrze wypełnione masą piankową. Nowatorska formuła - pianka slime w aksamitnej bańce. Możliwość ugniatania i naciągania. Gniotka można w każdej chwili umyć pod wodą. Piękne nasycone kolory.</p><p><br /></p><p>Rewelacyjny do ćwiczenia rączki w zabawny sposób, rekomendowany również jako narzędzie do rehabilitacji.</p><p><br /></p><p>Ćwiczy małą motorykę to doskonałe narzędzia do pracy podczas zajęć sensorycznych rozwijających małą motorykę</p><p><br /></p><p>Dorosłym osobom pomoże odreagować stres i wyciszyć emocje. Pełni funkcję gniotka odstresowywującego.</p><p>Uwaga! Przeznaczone do użytku pod nadzorem dorosłego.</p>', '<p>Kula sensoryczna 1szt.</p>\n<p>Duża, wytrzymała z pianką</p>\n<p>Wspaniałe kolory</p>', 'kule-sensoryczne-z-pianka-xl-teczowe', '', '', '', 'Kule sensoryczne z pianką XL tęczowe', '', '', '', ''),
(103, 1, 1, '', '<p>Push bubble pop it</p>\n<p>Baby Yoda w kolorystyce tęczowej.</p>', 'popit-baby-yoda-teczowa', '', '', '', 'popit baby yoda tęczowa', '', '', '', ''),
(104, 1, 1, '<p><strong>Dostępne różne kolory, przewaga niebieskiego, przewaga pistacjowego, przewaga różu, przewaga fioletu, przewaga czerwieni, przewaga limonki.</strong></p>\n<p>W przypadku braku wskazania we wiadomości dla sprzedającego bezpośrednio w formularzu zakupowym \"pole wiadomość dla sprzedawcy\" - wzór niespodzianka, zawsze piękne kolory.</p>\n<p></p>\n<p>Można wskazać również opcję kolorystyczną dla dziewczynki lub chłopca.</p>', '<p>Cudowny brelok - ciekawa ośmiorniczka</p>\n<p>Fidget Pop it - Ośmiorniczka Octupus</p>\n<p>kolorystyka galaxy</p>\n<p>* Rewelacyjny gadżet antystresowy. Śliczne kolory, super do ugniatania.</p>\n<p>* Można przyczepić ją do plecaka lub piórnika. Umili każdy dzień :)</p>', 'osmiornica-brelok-popit', '', '', '', 'Ośmiornica brelok popit', '', '', '', ''),
(105, 1, 1, '<p>Świetna jakość, piękne kolory</p>\n<p>Płynnie chodzi jest bardzo szybka i stabilna - idealna do bicia swoich rekordów. Antypoślizgowe naklejki</p>\n<p>Klasyczne kolory</p>\n<p>średnica: 68 mm</p>', '<h2>Kula logiczna</h2>\n<p>Super łamigłówka nie tylko dla najmłodszych</p>', 'kostka-kula-logiczna-fidget', '', '', '', 'kostka kula logiczna fidget', '', '', '', ''),
(106, 1, 1, '', '<p>fidget popit w cukierkowych kolorach</p>\n<p>wzór kokarda</p>\n<p></p>', 'popit-candy-kokarda', '', '', '', 'Popit candy kokarda', '', '', '', ''),
(107, 1, 1, '<p>Rewelacyjny do ćwiczenia rączki w zabawny sposób, rekomendowany również jako narzędzie do rehabilitacji.</p>\n<p>Ćwiczy małą motorykę to doskonałe narzędzia do pracy podczas zajęć sensorycznych rozwijających małą motorykę</p>\n<p>Dorosłym osobom pomoże odreagować stres i wyciszyć emocje. Pełni funkcję gniotka odstresowywującego.</p>\n<p></p>\n<p></p>\n<p></p>\n<p>Uwaga! Przeznaczone do użytku pod nadzorem dorosłego.</p>', '<p>Arbuzik kulka gniotek antystresowy </p>\n<p>Soczysty Arbuz</p>\n<p></p>\n<p>Gniotek 1szt - doskonale ugniatający się. Wodnista świeża poświatą wewnątrz.</p>\n<p>Klasyczny gniotek w ciekawej oprawie. Możliwość ugniatania i naciągania.</p>\n<p>Gniotka można w każdej chwili umyć pod wodą.</p>\n<p></p>', 'arbuz-kulka-gniotek-antystresowy', '', '', '', 'Arbuz kulka gniotek antystresowy', '', '', '', ''),
(108, 1, 1, '<p>1. POP IT Zabawka antystresowa nawiązuje do lubianej folii bąbelkowej. Można pstrykać z bąbelków w nieskończoność. Podczas tej zabawy możemy się odprężyć i rozluźnić. Dodatkowo przyciskaniu towarzyszy charakterystyczny dźwięk. Wykonany z sylikonu.</p>\n<p>2. Brelok Simple Dimple, zabawka zajmująca niespokojne dłonie w pięknej letniej odsłonie. Ślicznie kolorowa.  Dodatkowo wspaniały brelok..</p>\n<p>3. Gniotek Ananas typu Orbeez. Wewnątrz znajduje się wiele kulek, które można ściskać i ściskać. Super zabawa i jednocześnie ćwiczenie rączki.</p>\n<p>4. Bransoletka zmieniająca kolor UV typu Pop it!. Zabierz zabawkę ze sobą na wakacje. W słońcu zmieni kolor.</p>\n<p></p>\n<p>Zabawki to również doskonałe narzędzia do pracy podczas zajęć sensorycznych rozwijających małą motorykę, dorosłym zaś pomogą odreagować stres i wyciszyć emocje.</p>\n<p>Uwaga! Przeznaczone do użytku pod nadzorem dorosłego.</p>\n<p>W przypadku braku wskazania we wiadomości dla sprzedającego koloru ananasa: miętowy, żółty fluo, fioletowy lub malinowy - bezpośrednio w formularzu zakupowym \"pole wiadomość dla sprzedawcy\" - kolor niespodzianka, zawsze pięknie kolorowy widoczny na zdjęciach.</p>\n<p>Istnieje możliwość wskazania opcji kolorystycznej: zestaw dla dziewczynki lub zestaw dla chłopca.</p>\n<p></p>\n<p>Zabawki to również doskonałe narzędzia do pracy podczas zajęć sensorycznych rozwijających małą motorykę, dorosłym zaś pomogą odreagować stres i wyciszyć emocje.</p>\n<p>Uwaga! Przeznaczone do użytku pod nadzorem dorosłego.</p>', '<p>Letni i apetyczny Zestaw zabawek sensorycznych:</p>\n<h2>Summer Party Aloha</h2>\n<p>1. POP IT PUSH BUBBLE - silikonowe bąbelki 1 szt.</p>\n<p>2. Brelok simple dimple - 1 szt.</p>\n<p>3. Gniotek Ananas Orbeez - 1szt.</p>\n<p>4. Bransoletka Pop it UV - 1 szt.</p>', 'zestaw-fidgets-summer-aloha', '', '', '', 'zestaw fidgets summer aloha', '', '', '', ''),
(109, 1, 1, '<p>Rewelacyjny do ćwiczenia rączki w zabawny sposób, rekomendowany również jako narzędzie do rehabilitacji.</p>\n<p>Ćwiczy małą motorykę to doskonałe narzędzia do pracy podczas zajęć sensorycznych rozwijających małą motorykę.</p>\n<p>Dorosłym osobom pomoże odreagować stres i wyciszyć emocje. Pełni funkcję gniotka odstresowywującego.</p>\n<p></p>\n<p>Uwaga! Przeznaczone do użytku pod nadzorem dorosłego. W przypadku braku wyboru koloru w formularzu zakupowym, pole wiadomość dla sprzedawcy, kolor niespodzianka.</p>', '<p>Legendarny Ananas gniotek antystresowy</p>\n<p>Doskonale ugniatający się.</p>\n<p>Klasyczny gniotek w ciekawej oprawie.</p>\n<p>Możliwość ugniatania i naciągania. Gniotka można w każdej chwili umyć pod wodą.</p>', 'ananas-fluo-gniotek-aloha', '', '', '', 'Ananas Fluo gniotek aloha', '', '', '', ''),
(110, 1, 1, '', '<p>4 x pop tube - losowe kolory</p>\n<p>rozmiar L</p>\n<p><strong>komplet 4 sztuki</strong></p>', 'pop-tubes-duze-rurki-zabawki-sesnsoryczne-4szt', '', '', '', 'Pop tubes duże rurki zabawki sesnsoryczne 4szt', '', '', '', ''),
(111, 1, 1, '', '<p>4 x pop tube - losowe kolory</p>\n<p>rozmiar S</p>\n<p><strong>komplet 4 sztuki</strong></p>', 'pop-tubes-small-rurki-zabawki-antystresowe-4-szt', '', '', '', 'Pop tubes small rurki zabawki antystresowe 4 szt.', '', '', '', ''),
(112, 1, 1, '<p style=\"font-size:16px;color:#222222;font-family:\'Open Sans\', sans-serif;line-height:21px;\"><span style=\"color:#222222;font-family:\'Open Sans\', sans-serif;\"><span style=\"font-size:16px;\">1. POP IT PUSH BUBBLE - silikonowe bąbelki 1szt.</span></span></p>\n<p style=\"font-size:16px;color:#222222;font-family:\'Open Sans\', sans-serif;line-height:21px;\"><span style=\"color:#222222;font-family:\'Open Sans\', sans-serif;\"><span style=\"font-size:16px;\">2. Kula Logiczna - 1 szt. różnokolorowej kulki</span></span></p>\n<p style=\"font-size:16px;color:#222222;font-family:\'Open Sans\', sans-serif;line-height:21px;\"><span style=\"color:#222222;font-family:\'Open Sans\', sans-serif;\"><span style=\"font-size:16px;\">3. Simple Dimple brelok 1 szt.</span></span></p>', '<p>Zestaw zabawek sensorycznych do IS</p>', 'zestaw-fidget-toys', '', '', '', 'Zestaw fidget toys', '', '', '', ''),
(113, 1, 1, '', '<p>Popit w białej ramce z instrukcją gry.</p>\n<p>Piękne kolory, dużo zabawy.</p>\n<p>W komplecie zawieszka.</p>', 'push-popit-gra-kolorowa', '', '', '', 'Push Popit gra kolorowa', '', '', '', ''),
(114, 1, 1, '', '<p>Zabawka antystresowa.</p>\n<p>Wyraźny dźwięk pop!</p>\n<p>Nadruk moro w różnych kolorach.</p>', 'dimple-popit-fidget-moro', '', '', '', 'Dimple popit fidget moro', '', '', '', ''),
(115, 1, 1, '', '<p>lód w cukierkowych kolorach.</p>\n<p>Popit w kształcie loda na patyku.</p>', 'lod-na-patyku-popit-bubble-fidget', '', '', '', 'Lód na patyku popit bubble fidget', '', '', '', ''),
(116, 1, 1, '', '<p>Smaczny popit - ciastko.</p>\n<p>Słodkie, letnie kolory.</p>\n<p>popit!</p>', 'popit-cake-ciastko-pastelove', '', '', '', 'Popit cake ciastko pastelove', '', '', '', ''),
(117, 1, 1, '<p>Tęczowy fidget toy<br />-----</p>\n<p>Zabawka antystresowa nawiązuje do lubianej folii bąbelkowej. Można pstrykać z bąbelków w nieskończoność. Podczas tej zabawy możemy się odprężyć i rozluźnić. Dodatkowo przyciskaniu towarzyszy charakterystyczne dźwięk POP.</p>\n<p>-----</p>\n<p>Zabawka jest również doskonałym narzędziem do pracy podczas zajęć sensorycznych rozwijających małą motorykę dorosłym zaś pomoże odreagować stres i wyciszyć emocje.</p>\n<p>Materiał elastyczny: Silikon</p>\n<p>rzeczywiste zdjęcia produktu</p>', '<p>Pop it!<br />Wciśnij wszystkie bąbelki, wydadzą wyraźny dźwięk POP!</p>\n<p> </p>', 'popit-jednorozec-pastelowy-fidget', '', '', '', 'Popit jednorożec pastelowy fidget', '', '', '', ''),
(118, 1, 1, '', '<p>Ściśnij, puść, aby uzyskać bardzo satysfakcjonujące pop! :)</p>\n<p>Mega click!, Przyssawki</p>\n<p>mała motoryka</p>\n<p>pomaga złagodzić stres i niepokój.</p>', 'snapper-click-pop-it-fidget-toy', '', '', '', 'Snapper click pop it fidget toy', '', '', '', ''),
(119, 1, 1, '<p>bąbelki do wciskania<br />wyraźny dźwięk POP! podczas wciskania</p>\n<p>wykonana z wysokiej jakości tworzywa ABS</p>\n<p>Zabawka stymuluje zmysł dotyku i rozwój motoryki małej u dzieci.</p>\n<p>BĄBELKI DO WCISKANIA, ZABAWKA SENSORYCZNA</p>\n<p>---</p>\n<p>Rzeczywiste zdjęcia. W przypadku braku wskazania w formularzu zakupowym koloru panelu fioletowego lub zielonego, kolor niespodzianka.</p>', '<p>Fidget Toy Dimple<br />WYJĄTKOWO PIĘKNA KOLORYSTYKA</p>', 'fidget-toy-pop-it-dimple-z-brokatem', '', '', '', 'Fidget toy pop it Dimple z brokatem', '', '', '', ''),
(120, 1, 1, '', '<p>Gniotek Sticky Delfinek - 1szt.</p>\n<h2>Gniotek z kuleczkami wewnątrz.</h2>\n<p>Ciekawy przylegający do dłoni i bardzo bardzo naciągający się.</p>\n<p>Do wyboru kolor: niebieski, limonowy, fluo i koral.</p>\n<p>W przypadku braku wskazania koloru, kolor niespodzianka.</p>\n<p>Możliwość wyboru kolorystyki dla chłopca lub dla dziewczynki. </p>', 'sticky-gniotek-klejacy-zwierzatka', '', '', '', 'Sticky gniotek klejący zwierzątka', '', '', '', ''),
(121, 1, 1, '<p>Zabawki są również doskonałymi narzędziami do pracy podczas zajęć sensorycznych rozwijających małą motorykę, dorosłym zaś pomogą odreagować stres i wyciszyć emocje.</p>\n<p># Narzędzie do zajęć z integracji sensorycznej.</p>\n<p>Długość jednego sznurka ok 24 cm, szerokość ok 1cm.</p>\n<p>Materiał elastyczny: Silicon</p>', '<p>MONKEY NOODLE</p>\n<p>komplet 6 sztuk / mix kolorów</p>', 'noodle-stretch-strings-fidget-komplet-6szt', '', '', '', 'Noodle Stretch Strings fidget komplet 6szt', '', '', '', ''),
(122, 1, 1, '', '<h2>Brelok słodka ośmiorniczka</h2>\n<p>Śliczna pięknie kolorowa ze srebrnymi ozdobnikami. Ośmiorniczka dwustronna.</p>\n<h3>Milutki brelok, zawieszka. </h3>', 'osmiorniczka-dwustronna-brelok', '', '', '', 'Ośmiorniczka dwustronna brelok', '', '', '', ''),
(123, 1, 1, '<p></p>\n<h2>* Ciekawe kule wypełnione piankową masą</h2>\n<h3>* Nowa plastyczna formuła</h3>\n<h4>* Piękne kolory, po ściśnięciu widać kolejne kolory !!!</h4>\n<p></p>\n<p>Gniotki 4 szt. - doskonale ugniatające się.  Wnętrze wypełnione masą piankową. Klasyczne gniotki w nowatorskiej formule - pianka slime w sylikonowej bańce. Możliwość ugniatania i naciągania. Gniotka można w każdej chwili umyć pod wodą. Piękne perłowe kolory.</p>\n<p></p>\n<p>* Rewelacyjny do ćwiczenia rączki w zabawny sposób, rekomendowany również jako narzędzie do rehabilitacji.</p>\n<p></p>\n<p>* Ćwiczy małą motorykę to doskonałe narzędzia do pracy podczas zajęć sensorycznych rozwijających małą motorykę</p>\n<p></p>\n<p>* Dorosłym osobom starszych pomoże odreagować stres i wyciszyć emocje. Pełni funkcję gniotka odstresowywującego.</p>\n<p></p>\n<p></p>\n<p>Uwaga! Przeznaczone do użytku pod nadzorem dorosłego.</p>', '<p>Magiczne kule AKSAMIT gniotki antystresowe</p>\n<p>Zestaw = 4 sztuki - 8 kolorów</p>\n<p>w 4 AKSAMITNYCH kulach kryją się pianki innego koloru co daje łącznie efekt zaskoczenia gdyż po naciśnięciu widać nowy kolor. </p>', 'kule-sensoryczne-gniotki-aksamitne-4-szt', '', '', '', 'Kule sensoryczne gniotki aksamitne 4 szt.', '', '', '', ''),
(124, 1, 1, '', '<p>Kostka logiczna 2x2x3</p>\n<h2>Fruit series</h2>\n<p>znakomita jakość.</p>\n<p>Kostka odpowiednia zarówno dla początkujących i profesjonalistów.</p>\n<p>Idealna także na prezent.</p>', 'kostka-logiczna-banan', '', '', '', 'Kostka logiczna - banan', '', '', '', ''),
