(127, 1, 1, '', '<p>Kostka logiczna 3x3x3</p>\n<h2>Fruit series</h2>\n<p>znakomita jakość.</p>\n<p>Kostka odpowiednia zarówno dla początkujących i profesjonalistów.</p>\n<p>Idealna także na prezent.</p>', 'kostka-logiczna-gruszka', '', '', '', 'Kostka logiczna - gruszka', '', '', '', ''),
(128, 1, 1, '', '<p>Kostka logiczna 3x3x3</p>\n<h2>Fruit series</h2>\n<p>znakomita jakość.</p>\n<p>Kostka odpowiednia zarówno dla początkujących i profesjonalistów.</p>\n<p>Idealna także na prezent.</p>', 'kostka-logiczna-brzoskwinia', '', '', '', 'Kostka logiczna - brzoskwinia', '', '', '', ''),
(129, 1, 1, '', '<p>Kostka logiczna 3x3x3</p>\n<h2>Fruit series</h2>\n<p>znakomita jakość.</p>\n<p>Kostka odpowiednia zarówno dla początkujących i profesjonalistów.</p>\n<p>Idealna także na prezent.</p>', 'kostka-logiczna-cytryna', '', '', '', 'Kostka logiczna - cytryna', '', '', '', ''),
(130, 1, 1, '', '<p>Kolorowy zestaw na Lato!</p>\n<p>Pop it! i najlepsze zabawki :)</p>\n<p>1. Tęczowy Pop it! Wciśnij wszystkie bąbelki, wydadzą wyraźny dźwięk POP!</p>\n<p>2. Letni slime w letniej byteleczce</p>\n<p>3. Koło w przepięknych barwach z brokatem 70cm</p>\n<p>4. Zabawny Fidget Toy do zabawy w rączkach dodatkowo z LED</p>', 'summer-set', '', '', '', 'Summer set', '', '', '', ''),
(131, 1, 1, '', '<p>Zabawka antystresowa popit - gwiazda, kometa.</p>\n<p>Popit!</p>', 'pop-it-gwiazda', '', '', '', 'Pop it gwiazda', '', '', '', ''),
(132, 1, 1, '', '<p>Zabawka antystresowa.</p>\n<p>Kolorowy shake.</p>\n<p>Piękne, pastelowe kolory</p>\n<p>Popit!</p>', 'popit-shake-pastel-fidget', '', '', '', 'Popit shake pastel fidget', '', '', '', ''),
(133, 1, 1, '', '<p style=\"margin-top:0px;margin-bottom:1rem;color:#212529;font-family:\'-apple-system\', BlinkMacSystemFont, \'Segoe UI\', Roboto, \'Helvetica Neue\', Arial, sans-serif;font-size:16px;background-color:#ffffff;\">Duży popit kółko</p>\n<p style=\"margin-top:0px;margin-bottom:1rem;color:#212529;font-family:\'-apple-system\', BlinkMacSystemFont, \'Segoe UI\', Roboto, \'Helvetica Neue\', Arial, sans-serif;font-size:16px;background-color:#ffffff;\"><span style=\"color:#000000;font-family:Verdana, Arial, Helvetica, sans-serif;font-size:11px;background-color:#fafbfc;\">Jeszcze więcej zabawy.</span></p>', 'popit-xl-kolko-teczowe', '', '', '', 'Popit XL kółko tęczowe', '', '', '', ''),
(134, 1, 1, '', '<p>Duży popit sześciokąt</p>\n<p>Jeszcze więcej zabawy.</p>\n<p>20cm</p>', 'popit-xl-szesciokat-teczowy', '', '', '', 'Popit XL sześciokąt tęczowy', '', '', '', ''),
(135, 1, 1, '', '<p>Zabawka antystresowa popit - tęcza z chmurkami.</p>\n<p>Popit!</p>', 'pop-it-chmurka-fidget-toy', '', '', '', 'Pop it chmurka fidget toy', '', '', '', ''),
(136, 1, 1, '', '<p>Sensoryczny, elastyczny wężyk. Można go wyginać na wiele sposobów, łączyć pomiędzy sobą wiele sztuk.</p>\n<p>Zabawka stymulująca, która rozwija mózg i buduje zręczność palców.</p>', 'fidget-toy-twister-zabawka-antystresowa', '', '', '', 'Fidget toy twister zabawka antystresowa', '', '', '', ''),
(137, 1, 1, '<p>1. Bubble Fidget - Zabawka antystresowa nawiązuje do lubianej folii bąbelkowej. Można pstrykać z bąbelków w nieskończoność. Podczas tej zabawy możemy się odprężyć i rozluźnić. Dodatkowo przyciskaniu towarzyszy charakterystyczny dźwięk. Wykonany z siliconu.</p>\n<p>2. Twister kolorowy wąż Infinity - zapewnia doskonałą gimnastykę dłoni i świetną nieskończoną zabawę. Do wyboru kolorystyka chłopięca lub dziewczęca przedstawiona na zdjęciach.</p>\n<p>3. Fidget Simple Dimple Spinner Doskonały do ćwiczenia paluszków i doświadczania dotykiem. Do wyboru kolorystyka chłopięca lub dziewczęca przedstawiona na zdęciach.</p>\n<p>4. Slime budyń - do zabaw sensorycznych panda lub kotek z kuleczkami styropianowymi do zabawy sensorycznej 1 szt. Do wyboru kolorystyka chłopięca lub dziewczęca przedstawiona na zdjęciach.</p>\n<p>5. Gniotki mochi - ciekawe w dotyku, rozciągające się, mięciutkie, trochę przyczepiające się do dłoni. W zestawie 2 gniotki.</p>\n<p></p>\n<p>W przypadku braku wskazania we wiadomości do zamówienia bezpośrednio w formularzu zakupowym - kolor niespodzianka, zawsze jeden z  widocznych na zdjęciach.</p>', '<h2>Zestaw zabawek sensorycznych:</h2>\n<h4>do wyboru kolorystyka zestawu dziewczęca lub chłopięca</h4>\n<p></p>\n<p>1. Push Pop Bubble Fidget 1szt.</p>\n<p>2. Twister kolorowy wąż Infinity 1szt.</p>\n<p>3. Simple Dimple Spinner 1szt</p>\n<p>4. Slime / smooth pianka panda lub kotek  z kuleczkami 1szt.</p>\n<p>5. Gniotki Squishie Mochi 2 szt.</p>', 'zestaw-zabawek-antystresowych-slime', '', '', '', 'Zestaw zabawek antystresowych + slime', '', '', '', ''),
(138, 1, 1, '<p>REWELACYJNY PANEL SENSORYCZNY MOTORYCZNY</p>\n<p>WSPANIAŁA SŁODZIUTKA OWIECZKA</p>\n<p><br />Zabawka antystresowa nawiązuje do lubianej folii bąbelkowej. Można pstrykać z bąbelków w nieskończoność. Podczas tej zabawy możemy się odprężyć i rozluźnić. Dodatkowo przyciskaniu towarzyszy charakterystyczne dźwięk.</p>\n<p>* pozwala poprawić koncentrację</p>\n<p>* poprawi nastrój</p>\n<p>* ćwiczy sprawność motoryczną</p>\n<p>* wyjątkowo wesoły motyw</p>\n<p>Zabawka jest również doskonałym narzędziem do pracy podczas zajęć sensorycznych rozwijających małą motorykę dorosłym zaś pomoże odreagować stres i wyciszyć emocje.</p>\n<p>Kolorystyka dziewczęca lub chłopięca. Wybór prosimy wskazać w formularzu zakupowym w polu wiadomość dla sprzedawcy.</p>\n<p>Materiał elastyczny: Silicon</p>', '<p>Najsłodszy popit - owieczka</p>\n<p>do wyboru: niebieski lub różowy</p>', 'duzy-popit-owieczka-fidget-toy-bubble', '', '', '', 'Duży popit owieczka fidget toy bubble', '', '', '', ''),
(139, 1, 1, '', '<p>Fidget toy.</p>\n<p>Popit w sztywnej, plastikowej ramce.</p>\n<p>Cudowne wersje kolorystyczne.</p>\n<p>Do wyboru wersja kolorystyczna dla chłopca lub dziewczynki.</p>', 'pop-it-bubbles-plastikowe', '', '', '', 'Pop it bubbles plastikowe', '', '', '', ''),
(140, 1, 1, '', '<p>zabawka popit w cudownych kolorach.</p>\n<p>kólko</p>', 'pop-it-turkusowo-fioletowy', '', '', '', 'Pop it turkusowo fioletowy', '', '', '', ''),
(141, 1, 1, '', '<p>Dwa w jednym - spinner i simple dimple.</p>\n<p>Jeden fidget - podwójna radość.</p>\n<p>Pop it!</p>\n<p>Dwie wersje kolorystyczne, dla chłopca lub dziewczynki do wyboru.</p>', 'spinner-simple-dimple-x-5', '', '', '', 'Spinner simple dimple x 5', '', '', '', ''),
(142, 1, 1, '<p>1. POP IT Zabawka antystresowa nawiązuje do lubianej folii bąbelkowej. Można pstrykać z bąbelków w nieskończoność. Podczas tej zabawy możemy się odprężyć i rozluźnić. Dodatkowo przyciskaniu towarzyszy charakterystyczny dźwięk. Wykonany z sylikonu.</p>\n<p></p>\n<p>2. Kulka Kostka Logiczna 1szt- zapewnia doskonałą gimnastykę dłoni i umysłu. Należy przyciskać, przesuwać i dopasować w odpowiednie miejsca.</p>\n<p></p>\n<p>3. Pianki Magic Clay 12szt- Plastelina, piankolina w nowej niebrudzącej formule. Zapewnia wiele godzin wspaniałej kreatywnej zabawy. Jej ugniatanie jest ciekawym doznaniem gdyż jest ona bardzo miła w dotyku i plastyczna. W celu zapewnienia jej długiej przydatności należy zamykać ją w szczelnym pojemniku. Nie zabezpieczona wystyga i można z niej tworzyć kształty, które trwale zastygną,  niczym z modeliny. </p>\n<p></p>\n<p>4. Piłka z mochi - ciekawe doznania wzrokowe gdyż zwierzak zatopiony jest w magicznej kuli z wodą oraz cekinami- to prawdziwa świecąca niespodzianka oraz doskonałe ćwiczenia rączek. Piłkę można podrzucać, turlać lub delikatnie odbijać. 1szt z pośród prezentowanych.</p>\n<p></p>\n<p>5. Wesoła fasolka do zajęcia niespokojnych dłoni 1szt</p>\n<p></p>\n<p>6. Simple Dimple Spinner Pop It wesoły dimple to zrelaksowania się podczas obracania i pykania. Wersja kieszonkowa, pięknie kolorowa.</p>\n<p></p>\n<p>7. Slime Diamnet żelowa masa fioletowa, perłowa, zielona, różowa lub pomarańczowa.</p>\n<p></p>\n<p>8. Mochi słodki zwierzaczek gniotek 1szt.</p>\n<p></p>\n<p></p>\n<p></p>\n<p>Zabawki to również doskonałe narzędzia do pracy podczas zajęć sensorycznych rozwijających małą motorykę, dorosłym zaś pomogą odreagować stres i wyciszyć emocje.</p>\n<p></p>\n<p></p>\n<p></p>\n<p>Uwaga! Przeznaczone do użytku pod nadzorem dorosłego.</p>', '<p style=\"font-family:Helvetica, Tahoma, Verdana, Arial, sans-serif;font-size:13.3333px;\"><strong>Zestaw zabawek sensorycznych:</strong></p>\n<h2 style=\"font-family:Helvetica, Tahoma, Verdana, Arial, sans-serif;font-size:13.3333px;\">Summer Party</h2>\n<p style=\"font-family:Helvetica, Tahoma, Verdana, Arial, sans-serif;font-size:13.3333px;\">1. POP IT PUSH BUBBLE - silikonowe bąbelki 1 szt.</p>\n<p style=\"font-family:Helvetica, Tahoma, Verdana, Arial, sans-serif;font-size:13.3333px;\">2. Brelok słodka ośmiorniczka - 1 szt.</p>\n<p style=\"font-family:Helvetica, Tahoma, Verdana, Arial, sans-serif;font-size:13.3333px;\">3. Piankolina - Zestaw 12 szt.  Magic Clay </p>\n<p style=\"font-family:Helvetica, Tahoma, Verdana, Arial, sans-serif;font-size:13.3333px;\">4. Gniotek mochi w piłce 1 szt.</p>\n<p style=\"font-family:Helvetica, Tahoma, Verdana, Arial, sans-serif;font-size:13.3333px;\">5. Fasolka Fidget 1 szt.</p>\n<p style=\"font-family:Helvetica, Tahoma, Verdana, Arial, sans-serif;font-size:13.3333px;\">6. SIMPLE DIMPLE and SPINNER POP IT - 1 szt.</p>\n<p style=\"font-family:Helvetica, Tahoma, Verdana, Arial, sans-serif;font-size:13.3333px;\">7. Slime Diament żelowa stretch masa metaliczna 1 szt</p>\n<p style=\"font-family:Helvetica, Tahoma, Verdana, Arial, sans-serif;font-size:13.3333px;\"></p>', 'zestaw-fidget-toys-zabawki-antystresowe', '', '', '', 'Zestaw fidget toys zabawki antystresowe', '', '', '', ''),
(143, 1, 1, '<p>Wciśnij wszystkie bąbelki, wydadzą wyraźny dźwięk POP!</p>\n<p>Pastelowy fidget toy - wersja Summer Party !<br />-----</p>\n<p>Zabawka antystresowa nawiązuje do lubianej folii bąbelkowej. Można pstrykać z bąbelków w nieskończoność. Podczas tej zabawy możemy się odprężyć i rozluźnić. Dodatkowo przyciskaniu towarzyszy charakterystyczne dźwięk POP.</p>\n<p>-----</p>\n<p>Zabawka jest również doskonałym narzędziem do pracy podczas zajęć sensorycznych rozwijających małą motorykę dorosłym zaś pomoże odreagować stres i wyciszyć emocje.</p>\n<p>Materiał elastyczny: Silikon</p>\n<p>rzeczywiste zdjęcia produktu</p>', '<p>Fidget toy - Popit - kolorowy lód z literkami.</p>\n<p>Wspaniałe, pastelowe kolory</p>', 'pop-it-lod-icecream-bubble', '', '', '', 'Pop it Lód icecream bubble', '', '', '', ''),
(144, 1, 1, '', '<p>dwa w jednym. Dimple pop it + spinner</p>\n<p>Karuzela ruletka.</p>\n<p>Kolor do wyboru.</p>\n<p>W zestawie zawieszka.</p>', 'spinner-dimple-fidget-toy', '', '', '', 'Spinner dimple fidget toy', '', '', '', ''),
(145, 1, 1, '<p>Pierścienie magnetyczne antystresowe - rewelacyjna zabawa na wiele godzin.</p>', '<p>Ringi - pierścienie magnetyczne, antystresowe 3szt</p>', 'antystresowe-pierscienie-magnetyczne-fidget-toy', '', '', '', 'Antystresowe pierścienie magnetyczne fidget toy', '', '', '', ''),
(146, 1, 1, '<p>Różne wzory do wyboru.</p>', '<p>Poręczny spinner + pop it</p>', 'fidget-toy-spinner-mini-simple-dimple', '', '', '', 'Fidget toy spinner mini simple dimple', '', '', '', ''),
(147, 1, 1, '<p>Fidget Toy Dimple Ruletka</p>\n<p>bąbelki do wciskania</p>\n<p>wyraźny dźwięk POP! podczas wciskania.</p>\n<p></p>\n<p>Wysokiej jakości plastik. Nietoksyczny. Nie zawiera BPA. Wgłębienia są w 100% wykonane z silikonu spożywczego. Łatwe przechowywanie i czyszczenie</p>', '<p>Fantastyczna zabawka antystresowa.</p>\n<p>Motyl z nadrukiem. Wzór jednorożca i super kolorowe pop it.</p>\n<p></p>\n<p>Możliwość zawieszenia na smyczy.</p>', 'fidget-toy-spinner-pop-it-motyl', '', '', '', 'Fidget toy spinner pop it motyl', '', '', '', ''),
(148, 1, 1, '<p>1. POP IT PUSH BUBBLE silikonowe bąbelki 1szt.<br />2. Sticky gniotek z kuleczkami 1 szt.<br />3. Kula Logiczna motoryczna 1 szt.<br />4. Snapper - głośne pop it! 1 szt.<br />5. Fluo neon sticky kule gniotki z pianką wewnątrz 3 szt.<br />6. Zip zamek antystresowy 1 szt.<br />7. Gniotek wesoły krab z kuleczkami orbeez 1 szt.<br />8. Masa slime z brokatem w babeczce 1 szt.<br />9. Legendary Fidget Wiewióra 1 szt.<br />10. Gniotek z fluo kulkami wewnątrz 1 szt.<br />11. Kostka motoryczna 1 szt.</p>\n<p> </p>\n<p>W przypadku braku wskazania we wiadomości dla sprzedającego bezpośrednio w formularzu zakupowym \"pole wiadomość dla sprzedawcy\" - wzór niespodzianka, zawsze pięknie kolorowe widoczny na zdjęciach.</p>\n<p>Istnieje możliwość wskazania opcji kolorystycznej dla dziewczynki lub dla chłopca.</p>\n<p>------------</p>\n<p>Zabawki to również doskonałe narzędzia do pracy podczas zajęć sensorycznych rozwijających małą motorykę, dorosłym zaś pomogą odreagować stres i wyciszyć emocje.</p>\n<p>------------</p>\n<p>Uwaga! Przeznaczone do użytku pod nadzorem dorosłego.</p>', '<p>Mega zestaw zabawek antystresowych:<br />14 szt najlepszych fidgetów w jednym zestawie.</p>', 'zestaw-fidget-toys-minnie-pop-it', '', '', '', 'Zestaw fidget toys minnie pop it', '', '', '', ''),
(149, 1, 1, '<p>Fidget Toy Dimple Ruletka</p>\n<p>bąbelki do wciskania</p>\n<p>wyraźny dźwięk POP! podczas wciskania.</p>\n<p></p>\n<p>Wysokiej jakości plastik. Nietoksyczny. Nie zawiera BPA. Wgłębienia są w 100% wykonane z silikonu spożywczego. Łatwe przechowywanie i czyszczenie</p>', '<p>Połączenie simple dimple pop it i spinnera.</p>\n<p>Zabawka antystresowa lub gra.</p>\n<p>średnica 15cm</p>', 'dimple-spinner-pop-it-zabawka-antystresowa', '', '', '', 'Dimple Spinner pop it zabawka antystresowa', '', '', '', ''),
(150, 1, 1, '', '', 'ges-gniotek-fidget-toy', '', '', '', 'Gęś gniotek fidget toy', '', '', '', ''),
(151, 1, 1, '<p>Gniotek 1szt - doskonale ugniatający się. Ze złotą poświatą wewnątrz. Klasyczny gniotek w ciekawej oprawie. Możliwość ugniatania i naciągania. Gniotka można w każdej chwili umyć pod wodą.</p>\n<p>* Rewelacyjny do ćwiczenia rączki w zabawny sposób, rekomendowany również jako narzędzie do rehabilitacji.</p>\n<p>* Ćwiczy małą motorykę to doskonałe narzędzia do pracy podczas zajęć sensorycznych rozwijających małą motorykę</p>\n<p></p>\n<p>* Dorosłym osobom pomoże odreagować stres i wyciszyć emocje. Pełni funkcję gniotka odstresowywującego.</p>', '<p>Słodka świnka kulka gniotek antystresowy </p>\n<p>ZŁOTA ŚWINKA NA SZCZĘŚCIE </p>', 'gniotek-swinka', '', '', '', 'Gniotek świnka', '', '', '', ''),
(152, 1, 1, '', '<p>Maskotka dwustronna - kotek Kawaii Maskotka Kiciuś - doskonały pomysł na określanie i wyrażanie emocji.</p>\n<p>To również sprytny pretekst do rozmowy o nich.</p>\n<p>Dwukolorowa, dwustronna i mięciutka.</p>', 'maskotka-dwustronna-kotek-kawaii', '', '', '', 'Maskotka dwustronna kotek Kawaii', '', '', '', ''),
(153, 1, 1, '', '<p>Zabawki sensoryczne 2 szt.</p>\n<p>Push Pop Bubble Fidget + snapper</p>\n<p>1. Fidget Bubble - Zabawka antystresowa nawiązuje do lubianej folii bąbelkowej. Można pstrykać z bąbelków w nieskończoność. Podczas tej zabawy możemy się odprężyć i rozluźnić. Dodatkowo przyciskaniu towarzyszy charakterystyczne dźwięk.</p>\n<p>2. Snapper \"pstrykacz\" - Ciekawy gadżet z możliwością wciskania, dociskania i odpstrykiwania. Doskonała do ćwiczenia paluszków i doświadczania dotykiem. Na jednej stronie znajduje się przycisk niczym włącznik. Super jako narzędzie do rehabilitacji ręki.</p>\n<p>Zabawki pomogą odreagować stres i wyciszyć emocje.</p>', 'zestaw-teczowy-fidgets-pop-it-snapper', '', '', '', 'Zestaw tęczowy fidgets pop it + snapper', '', '', '', ''),
(154, 1, 1, '', '<p>Zabawka antystresowa</p>\n<p>pop it!</p>', 'pop-it-kwadrat-teczowy-bubble', '', '', '', 'Pop it kwadrat tęczowy bubble', '', '', '', ''),
(155, 1, 1, '', '<p>Możliwość łączenia ze sobą kolejnych łańcuchów.</p>\n<p>Do wyboru: Niebieski-Pomarańczowy/ Zielony-Pomarańczowy/ Zielony-Niebieski.</p>\n<p>Łańcuch antystresowy z którego można stworzyć dowolne kształty. Każdy ruch wydaje charakterystyczny klik. Każde ogniwo można wygiąć w pięciu kierunkach (na prawo, na lewo , na wprost, 2 x na ukos)</p>\n<p></p>\n<p></p>', 'lancuch-fidget-toy-chain', '', '', '', 'Łańcuch fidget toy chain', '', '', '', ''),
(156, 1, 1, '<h2>Rewelacyjny ściskacz z dużą ilością kuleczek ORBEEZ</h2>\n<p>Gniotek squishy 1szt - doskonale ugniatający się. Z kuleczkami wewnątrz. Klasyczny gniotek w ciekawej oprawie. Możliwość ugniatania i naciągania.</p>\n<p>* Rewelacyjny do ćwiczenia rączki w zabawny sposób, rekomendowany również jako narzędzie do rehabilitacji.</p>\n<p>* Ćwiczy małą motorykę to doskonałe narzędzia do pracy podczas zajęć sensorycznych rozwijających małą motorykę</p>\n<p>* Dorosłym osobom starszych pomoże odreagować stres i wyciszyć emocje. Pełni funkcję gniotka odstresowywującego.</p>\n<p>----</p>\n<p>Uwaga! Przeznaczone do użytku pod nadzorem dorosłego.</p>', '<p>Gniotek antystresowy typu orbeez.</p>\n<p>Miły w dotyku, umili czas. Odpręży, miło przelewające sie kuleczki żelowe. Po wstrząśnięciu świeci dając krystaliczne efekty. </p>\n<p>łatwy do pielęgnacji, wystarczy umyć go pod wodą.</p>', 'swiecacy-gniotek-orbeez-delfin', '', '', '', 'Świecący gniotek orbeez delfin', '', '', '', ''),
(157, 1, 1, '', '<p>Ściśnij, puść, aby uzyskać bardzo satysfakcjonujące pop! :)</p>\n<p>Mega click!, Przyssawki</p>\n<p>mała motoryka</p>\n<p>pomaga złagodzić stres i niepokój.</p>\n<p></p>', 'snapperz-click-pop-it-fidget-snapper', '', '', '', 'Snapperz click pop it fidget Snapper', '', '', '', ''),
(158, 1, 1, '<p>Możliwość zdejmowania, zakładania i wymiany ubranka<br />----</p>\n<p>* Wypełniony piankową masą</p>\n<p>* Nowa plastyczna formuła</p>\n<p>* Ciekawe doznania sensoryczne</p>\n<p>* Wspomaga małą motorykę i ćwiczy rączki</p>\n<p>----</p>\n<p>Wnętrze wypełnione masą piankową. Można ją ugniatać i ugniatać :). Klasyczne gniotki w nowatorskiej formule - pianka slime ukryta we wnętrzu gniotka. Możliwość ugniatania i naciągania. Gniotka można w każdej chwili umyć pod wodą. Kolor: zielony, biały, różowy, cytrynowy.</p>\n<p>* Rewelacyjny do ćwiczenia rączki w zabawny sposób, rekomendowany również jako narzędzie do rehabilitacji.<br />* Ćwiczy małą motorykę to doskonałe narzędzia do pracy podczas zajęć sensorycznych rozwijających małą motorykę<br />* Dorosłym osobom pomoże odreagować stres i wyciszyć emocje. Pełni funkcję gniotka odstresowywującego.<br />* Pomocny w ćwiczeniu skupienia uwagi np. podczas zajęć.<br />----</p>\n<p>Istnieje możliwość wskazania koloru w formularzu zakupowym w polu wiadomość dla sprzedającego. W przypadku braku wskazania, kolor niespodzianka.</p>\n<p>Uwaga! Przeznaczone do użytku pod nadzorem dorosłego.</p>', '<p>Gniotek Antystresowy w stylu KAWAII <br />Słodziutki Zwierzaczek W Ubranku 1 szt.</p>', 'gniotek-antystresowy-z-ubrankiem-kapturkiem', '', '', '', 'Gniotek antystresowy z ubrankiem kapturkiem', '', '', '', ''),
(159, 1, 1, '', '<p>Duży Pop It!</p>\n<p>Kształt Myszka Minnie</p>\n<p>Tęczowe kolory</p>', 'pop-it-minnie-mouse-fidget-toy', '', '', '', 'Pop it minnie mouse fidget toy', '', '', '', ''),
(160, 1, 1, '<p>- działa antystresowo i odstresowująco, posiada karabińczyk </p>\n<p>- dla dzieci i dorosłych</p>\n<p>- kolor \"przycisków\" - różowy, niebieski i zielony, pomarańczowa</p>\n<p>- ~ 7x8x1,2 cm</p>\n<p>- rzeczywiste zdjęcia</p>', '<p>Brelok bąbelkami do wciskania - po wciśnięciu  wyraźny dźwięk POP IT!</p>\n<p>SIMPLE DIMPLE</p>\n<p>- karabińczyk</p>\n<p></p>', 'pop-it-popit-fidget-toy-push-bubble-simple-dimple', '', '', '', 'Pop it popit fidget toy push bubble simple dimple', '', '', '', ''),
(161, 1, 1, '', '<p>Nieskończona ilość bąbelków. Mega duży panel. Długość 44cm</p>', 'popit-jumbo-gigant-xl-motyl', '', '', '', 'Popit Jumbo Gigant XL Motyl', '', '', '', ''),
(162, 1, 1, '<p>1. POP IT PUSH BUBBLE - silikonowe bąbelki 1 szt.<br />2. Fidget twister - 1 szt.<br />3. Piankolina slime - Zestaw 2 szt. Magic Clay <br />4. Gniotek super słodziutki i mięciutki mochi 1 szt.<br />5. Kuleczki kauczukowe galaxy 4 szt.<br />6. Świnka - gniotek z piaskiem do miłego ugniatania 1 szt.<br />7. Dimple kolorowy duży jednorożec 1 szt.<br />8. Laleczka squishy 1 szt.</p>\n<p> </p>\n<p>Dostępne różne kolory Dimple Pop it. W przypadku braku wskazania we wiadomości dla sprzedającego bezpośrednio w formularzu zakupowym \"pole wiadomość dla sprzedawcy\" - wzór niespodzianka, zawsze pięknie kolorowe widoczny na zdjęciach.</p>\n<p>Istnieje możliwość wskazania opcji kolorystycznej: zestaw z laleczką z różowymi włosami lub zestaw z laleczką z fioletowymi włosami.</p>\n<p>Zabawki to również doskonałe narzędzia do pracy podczas zajęć sensorycznych rozwijających małą motorykę, dorosłym zaś pomogą odreagować stres i wyciszyć emocje.</p>\n<p>Uwaga! Przeznaczone do użytku pod nadzorem dorosłego.</p>', '<p>Zestaw zabawek sensorycznych:</p>', 'fidget-toys-super-zestaw-slime-squishy-popit', '', '', '', 'Fidget toys super zestaw slime squishy popit', '', '', '', ''),
(163, 1, 1, '', '<p>Nieskończona ilość bąbelków. Mega duży panel 30cm x 30cm</p>', 'popit-jumbo-gigant-xl', '', '', '', 'Popit Jumbo Gigant XL', '', '', '', ''),
(164, 1, 1, '', '<p>Among us dwustronny pluszak</p><p>łatwa zmiana w impostora</p>', 'maskotka-dwustronna-among-us-impostor', '', '', '', 'Maskotka dwustronna among us impostor', '', '', '', ''),
(165, 1, 1, '', '<p>Squishy wypełniony piaskiem </p><p>banan (12,5×3,5 cm) </p><p>antystresowy, sensoryczny. Super rozciągliwy!</p>', 'gniotek-banan-sesnsoryczny-z-piaskiem', '', '', '', 'Gniotek banan sesnsoryczny z piaskiem', '', '', '', ''),
(166, 1, 1, '<p>Maskotka Octopus - doskonały pomysł na określanie i wyrażanie emocji.</p>\n<p>To również sprytny pretekst do rozmowy o nich.</p>\n<p>Dwukolorowa, dwustronna i mięciutka.</p>\n<p><img src=\"/18266-pdt_1400/octopus-osmiornica-pluszowa-maskotka-dwustronna.jpg\" alt=\"\" width=\"1400\" height=\"1400\" /></p>\n<p>W przypadku braku wskazania we wiadomości dla sprzedającego bezpośrednio w formularzu zakupowym \"pole wiadomość dla sprzedawcy\" - wzór niespodzianka, zawsze pięknie tęczowy widoczny na zdjęciach.</p>\n<p>Można wskazać również opcję kolorystyczną dla dziewczynki lub chłopca.</p>\n<p></p>\n<p>Uwaga! Zabawki przeznaczone do użytku pod nadzorem dorosłego.</p>', '<p>Maskotka Ośmiorniczka Octupus - dwustronna</p>\n<p><span style=\"font-family:Helvetica, Tahoma, Verdana, Arial, sans-serif;font-size:13.3333px;\">Dostępne różne kolory.</span></p>', 'octopus-osmiornica-pluszowa-maskotka-dwustronna', '', '', '', 'Octopus ośmiornica pluszowa maskotka dwustronna', '', '', '', ''),
(167, 1, 1, '<p></p>\n<p>Zasady gry: ukryj kulkę pod jednym bąbelkiem i poprosić osobę o wskazanie miejsca gdzie ona jest ukryta.</p>\n<p>Kulki wykonane ze szkła.</p>\n<p></p>\n<p>Uwaga: przeznaczone do zabawy pod kontrolą osoby dorosłej.</p>', '<p>Zestaw 3 szt kulek do gry Push Up Bubble. </p>\n<p>3 Kulki galaxy</p>', 'kulki-do-push-it-fidget-pop-it', '', '', '', 'Kulki do push it fidget POP IT', '', '', '', ''),
(168, 1, 1, '<p>Zabawka jest również doskonałym narzędziem do pracy podczas zajęć sensorycznych rozwijających małą motorykę dorosłym zaś pomoże odreagować stres i wyciszyć emocje.</p>', '<p>Zabawka antystresowa nawiązuje do lubianej folii bąbelkowej. Można pstrykać z bąbelków w nieskończoność.</p>\n<p>Dodatkowo przyciskaniu towarzyszy charakterystyczne dźwięk. POP IT!</p>', 'push-pop-it-teczowy-osmiornica-bubble', '', '', '', 'PUSH POP IT tęczowy ośmiornica Bubble', '', '', '', ''),
(169, 1, 1, '<p>Zabawka jest również doskonałym narzędziem do pracy podczas zajęć sensorycznych rozwijających małą motorykę dorosłym zaś pomoże odreagować stres i wyciszyć emocje.</p>', '<p>Zabawka antystresowa nawiązuje do lubianej folii bąbelkowej. Można pstrykać z bąbelków w nieskończoność.</p>\n<p>Dodatkowo przyciskaniu towarzyszy charakterystyczne dźwięk. POP IT!</p>', 'push-pop-it-teczowy-hexagon-bubble', '', '', '', 'PUSH POP IT tęczowy hexagon Bubble', '', '', '', ''),
(170, 1, 1, '<p>1. POP IT PUSH BUBBLE - silikonowe bąbelki 1 szt.</p>\n<p>2. Zawieszka słodka ośmiorniczka POP it - 1 szt.</p>\n<p>3. Piłka anystresowa 3D Push Bubble POP it - 1 szt.</p>\n<p>4. Metalowe pierścienie Flippy Chain Fidget Toy - 1 szt</p>\n<p>5. Kostka antystresowa Infinity Galaxy 1szt.</p>\n<p>----</p>\n<p>Zabawki antystresowe to również doskonałe narzędzia do pracy podczas zajęć integracji sensorycznej, rozwijających małą motorykę. Dorosłym pomogą odreagować stres i wyciszyć emocje. Polecane również jako pomoce rehabilitacyjne.</p>\n<p> </p>\n<p>Uwaga! Przeznaczone do użytku pod nadzorem dorosłego.</p>', '<p>Zestaw zabawek sensorycznych. Lubiane i niezawodne antystresowe fidget toys w rewelacyjnych kolorach:</p>', 'zestaw-fidget-toys-popit', '', '', '', 'Zestaw fidget toys Popit', '', '', '', ''),
(171, 1, 1, '<p>Zabawka jest również doskonałym narzędziem do pracy podczas zajęć sensorycznych rozwijających małą motorykę dorosłym zaś pomoże odreagować stres i wyciszyć emocje.</p>', '<p>Zabawka antystresowa nawiązuje do lubianej folii bąbelkowej. Można pstrykać z bąbelków w nieskończoność.</p>\n<p>Dodatkowo przyciskaniu towarzyszy charakterystyczne dźwięk. POP IT!</p>', 'push-pop-it-teczowy-kolko-bubble', '', '', '', 'PUSH POP IT tęczowy kólko Bubble', '', '', '', ''),
(172, 1, 1, '<p>Zabawka jest również doskonałym narzędziem do pracy podczas zajęć sensorycznych rozwijających małą motorykę dorosłym zaś pomoże odreagować stres i wyciszyć emocje.</p>', '<p>Zabawka antystresowa nawiązuje do lubianej folii bąbelkowej. Można pstrykać z bąbelków w nieskończoność.</p>\n<p>Dodatkowo przyciskaniu towarzyszy charakterystyczne dźwięk. POP IT!</p>', 'push-pop-it-teczowy-puzzle-zabawka-sensoryczna', '', '', '', 'PUSH POP IT tęczowy puzzle zabawka sensoryczna', '', '', '', ''),
(173, 1, 1, '<p>Zabawka jest również doskonałym narzędziem do pracy podczas zajęć sensorycznych rozwijających małą motorykę dorosłym zaś pomoże odreagować stres i wyciszyć emocje.</p>', '<p>Zabawka antystresowa nawiązuje do lubianej folii bąbelkowej. Można pstrykać z bąbelków w nieskończoność.</p>\n<p>Dodatkowo przyciskaniu towarzyszy charakterystyczne dźwięk. POP IT!</p>', 'push-pop-it-teczowy-among-us-fidget', '', '', '', 'PUSH POP IT tęczowy among us fidget', '', '', '', ''),
(174, 1, 1, '<p>Kostka bez naklejek - wykonana jest w całości z barwionego plastiku.</p>\n<p>Delikatna, pastelowa kolorystyka.</p>\n<p>Jest szybka i stabilna - idealna do nauki oraz bicia swoich rekordów.</p>\n<p>6 cm x 6 cm x 6 cm</p>\n<p>Rzeczywiste zdjęcia</p>', '<p>Kostka Logiczna 5x5x5 MoYu<br />PASTEL COLORS</p>', 'kostka-logiczna-5x5x5-pastel-moyu', '', '', '', 'Kostka logiczna 5x5x5 pastel moyu', '', '', '', ''),
(175, 1, 1, '<p>Kostka bez naklejek - wykonana jest w całości z barwionego plastiku.</p>\n<p>Delikatna, pastelowa kolorystyka.</p>\n<p>Jest szybka i stabilna - idealna do nauki oraz bicia swoich rekordów.</p>\n<p>6 cm x 6 cm x 6 cm</p>\n<p>Rzeczywiste zdjęcia</p>', '<p>Kostka Logiczna 4x4x4 MoYu<br />PASTEL COLORS</p>', 'kostka-logiczna-4x4x4-pastel-moyu', '', '', '', 'Kostka logiczna 4x4x4 pastel moyu', '', '', '', ''),
(176, 1, 1, '<p>1. <strong>Bubble Fidget</strong> - Zabawka antystresowa nawiązuje do lubianej folii bąbelkowej.</p>\n<p>Można pstrykać z bąbelków w nieskończoność. Podczas tej zabawy możemy się odprężyć i rozluźnić. Dodatkowo przyciskaniu towarzyszy charakterystyczny dźwięk. Wykonany z siliconu.</p>\n<p>2. <strong>Piłka na gumce</strong>- zapewnia doskonałą gimnastykę dłoni oraz ćwiczy refleks. Zaletą jest to, że piłka nie ucieknie daleko ;)</p>\n<p>3. <strong>Maskotka Octopus</strong> - doskonały pomysł na określanie i wyrażanie emocji. To również sprytny pretekst do rozmowy o nich. Dwukolorowa, dwustronna i mięciutka.</p>\n<p>4. <strong>Slime w pojemniku 2 kolory</strong> - ciekawe w dotyku, rozciągające się, elastyczne. Lubiane masy do zabawy w ugniatanie jednocześnie rozładowują napięcia.</p>\n<p>Zabawki to również doskonałe narzędzia do pracy podczas zajęć sensorycznych rozwijających małą motorykę, dorosłym zaś pomogą odreagować stres i wyciszyć emocje.</p>\n<p></p>\n<p>Dostępne różne kolory. W przypadku braku wskazania we wiadomości do zamówienia - wzór niespodzianka, zawsze pięknie tęczowy widoczny na zdjęciach. Można wskazać również opcję kolorystyczną dla dziewczynki lub chłopca.</p>\n<p></p>\n<p>Uwaga! Zabawki przeznaczone do użytku pod nadzorem dorosłego.</p>', '<p>Zestaw zabawek sensorycznych:</p>\n<p></p>\n<p>1. Push Pop Bubble Fidget Ośmiornica</p>\n<p>2. Piłka na gumce na nadgarstek</p>\n<p>3. Maskotka Ośmiorniczka Octupus - dwustronna</p>\n<p>4. Slime 2 kolory, zamknięty w ciekawym pojemniczku</p>', 'komplet-fidget-toys-z-pluszowa-osmiornica', '', '', '', 'Komplet fidget toys z pluszową ośmiornicą', '', '', '', '');
INSERT INTO `ps_product_lang` (`id_product`, `id_shop`, `id_lang`, `description`, `description_short`, `link_rewrite`, `meta_description`, `meta_keywords`, `meta_title`, `name`, `available_now`, `available_later`, `delivery_in_stock`, `delivery_out_stock`) VALUES
(177, 1, 1, '<p>1. POP IT Zabawka antystresowa nawiązuje do lubianej folii bąbelkowej. Można pstrykać z bąbelków w nieskończoność. Podczas tej zabawy możemy się odprężyć i rozluźnić. Dodatkowo przyciskaniu towarzyszy charakterystyczny dźwięk. Wykonany z sylikonu.</p>\n<p>2. Kulka Kostka Logiczna 1szt- zapewnia doskonałą gimnastykę dłoni i umysłu. Należy przyciskać, przesuwać i dopasować w odpowiednie miejsca.</p>\n<p>3. Pianki Magic Clay 12szt- Plastelina, piankolina w nowej niebrudzącej formule. Zapewnia wiele godzin wspaniałej kreatywnej zabawy. Jej ugniatanie jest ciekawym doznaniem gdyż jest ona bardzo miła w dotyku i plastyczna. W celu zapewnienia jej długiej przydatności należy zamykać ją w szczelnym pojemniku. Nie zabezpieczona wystyga i można z niej tworzyć kształty, które trwale zastygną, niczym z modeliny.</p>\n<p>4. Gniotko Squishy mochi - ciekawe i milutkie figurki doskonałe do ćwiczenia rączek. Mięciutkie. 2szt</p>\n<p> </p>\n<p>Zabawki to również doskonałe narzędzia do pracy podczas zajęć sensorycznych rozwijających małą motorykę, dorosłym zaś pomogą odreagować stres i wyciszyć emocje.</p>\n<p> </p>\n<p>Uwaga! Przeznaczone do użytku pod nadzorem dorosłego.</p>', '<p>Zestaw zabawek sensorycznych:</p>\n<p><br />1. POP IT PUSH BUBBLE - silikonowe bąbelki 1szt<br />2. Kula Logiczna - 1 szt różnokolorowej kulki<br />3. Piankolina - Zestaw 12 szt Magic Clay <br />4. Gniotek mochi 2 szt</p>', 'zestaw-sensoryczny-fidget-toys-pop-it-slime', '', '', '', 'Zestaw Sensoryczny Fidget Toys POP IT Slime', '', '', '', ''),
(178, 1, 1, '<p> </p>\n<p>Gniotki mochi - malutkie, słodkie, sylikonowe figurki squishie.</p>\n<p>Saszetki niespodzianki są specjalnie przygotowane przez procenta w taki sposób aby można było zbierać swoją unikatową kolekcję Mochi.</p>\n<p>Otrzymują Państwo 9 sztuk gniotków niespodzianek w specjalnych saszetkach.</p>\n<p>&gt;&gt;&gt; ZBIERZ SWOJĄ SŁODZIAKOWĄ KOLEKCJĘ MOCHI I WYMIENIAJ SIĘ ZE ZNAJOMYMI !</p>\n<p> </p>\n<p>Zabawki to również doskonałe narzędzia do pracy podczas zajęć sensorycznych rozwijających małą motorykę, dorosłym zaś pomogą odreagować stres i wyciszyć emocje. </p>\n<p>------</p>\n<p>Polecamy również jako miły prezent.</p>\n<p>------</p>\n<p>Uwaga! Zabawki przeznaczone do użytku pod nadzorem dorosłego</p>', '<p>Duży Zestaw zabawek sensorycznych:</p>\n<p> &gt;&gt;  <strong>9 sztuk Mochi Squishie</strong>  &lt;&lt; </p>', 'zestaw-mochi-squishy-squishies-gniotki-fidget-toys', '', '', '', 'Zestaw MOCHI Squishy Squishies GNIOTKI FIDGET TOYS', '', '', '', ''),
(179, 1, 1, '<p>doskonałe narzędzia do pracy podczas zajęć sensorycznych rozwijających małą motorykę, dorosłym zaś pomogą odreagować stres i wyciszyć emocje.</p><p>Wykonane z gumy </p><p>----</p><p>rzeczywiste zdjęcia produktu</p>', '<p>Jajko sadzone do ściskania, rozciągania, zabawy.</p>', 'jajko-sadzone-fidget-toy', '', '', '', 'jajko sadzone Fidget Toy', '', '', '', ''),
(180, 1, 1, '<p>POP it! bąbelki do wciskania</p><p>1 x dysk dimple z pięcioma bombelkami </p><h2>Wyraźny dźwięk POP! podczas wciskania</h2><p>Wykonana z wysokiej jakości tworzywa ABS</p><p>Zabawka stymuluje zmysł dotyku i rozwój motoryki małej u dzieci.</p><p>-----</p><p><strong>Gniotki Squishie Mochi</strong></p><p><strong>4 x słodkie mochi</strong>. Ciekawe w dotyku, rozciągające się, mięciutkie, trochę przyczepiające się do dłoni. </p><p>Saszetki niespodzianki są specjalnie przygotowane przez procenta w taki sposób aby można było zbierać swoją unikatową kolekcję Mochi.</p><p>Otrzymują Państwo 4 sztuki gniotków niespodzianek w specjalnych saszetkach.</p><p><br /></p><p>Zabawki to również doskonałe narzędzia do pracy podczas zajęć sensorycznych rozwijających małą motorykę, dorosłym zaś pomogą odreagować stres i wyciszyć emocje. </p><p>Polecamy również jako miły prezent.</p><p>rzeczywiste zdjęcia</p><p><strong>dostępne 5 wersji kolorystycznych</strong></p><p>Uwaga! Zabawki przeznaczone do użytku pod nadzorem dorosłe</p>', '<p>Mega Zestaw zabawek sensorycznych:</p><p>Fidget Toy Dimple + 4 Squishie Mochi</p>', 'komplet-mochi-squishies-dimple-pop-it', '', '', '', 'Komplet Mochi Squishies + Dimple Pop it', '', '', '', ''),
(181, 1, 1, '<p></p>\n<p>Fidget Cube kostka <strong>motoryczna</strong> - kostka antystresowa 1szt.</p>\n<p>Ciekawy gadżet z możliwością <strong>wciskania</strong> i przesuwania elementów.</p>\n<p>Doskonała do <strong>ćwiczenia</strong> paluszków i doświadczania <strong>dotykiem</strong>.</p>\n<p>Na jednej stronie znajduje się przycisk niczym włącznik.</p>\n<p>Rozmiar kostki 4cm x 4xm</p>\n<p>Zapakowana w oryginalny kartonik</p>\n<p>Idealna także na prezent</p>\n<p>---------</p>\n<p>Zabawki to również doskonałe narzędzia do pracy podczas zajęć sensorycznych rozwijających małą motorykę, dorosłym zaś pomogą odreagować stres i wyciszyć emocje.</p>\n<p>---------</p>\n<p>Rzeczywiste zdjęcia</p>', '<p><strong>Fidget Cube</strong></p>\n<p>Kostka antystresowa, odstresowująca</p>', 'kostka-antystresowa-odstresowujaca-fidget-cube', '', '', '', 'Kostka antystresowa odstresowująca Fidget Cube', '', '', '', ''),
(182, 1, 1, '<p>Idealna także na dobry prezent</p>\n<p>W oryginalnym opakowaniu znajduje się prosta instrukcja</p>\n<p>Jak każda kostka od ShengShou doskonale \"tnie\" boki.</p>\n<p>Polecamy, to najlepszy mirror</p>', '<p>Kostka Logiczna typu mirror 3x3x3 </p>\n<p>black gold </p>\n<h2>ShengShou</h2>\n<p>Doskonała kostka - doskonale spasowana, w ogóle się nie zacina dzięki czemu jest przyjemność z układania.</p>\n<p>Są śrubki regulacyjne. Można ustawić kostkę według własnych preferencji.</p>\n<p>Idealnie wyważona, Wysokiej jakości tworzywo, piękny złoty kolor</p>\n<p>Rzeczywiste zdjęcia</p>', 'kostka-logiczna-mirror-gold', '', '', '', 'Kostka logiczna Mirror gold', '', '', '', ''),
(183, 1, 1, '<p>Zasady gry z kulkami: ukryj kulkę pod jednym bąbelkiem i poprosić osobę o wskazanie miejsca gdzie ona jest ukryta.</p>\n<p>Zabawka antystresowa nawiązuje do lubianej folii bąbelkowej. Można pstrykać z bąbelków w nieskończoność. Podczas tej zabawy możemy się odprężyć i rozluźnić. Dodatkowo przyciskaniu towarzyszy charakterystyczne dźwięk.</p>\n<p></p>\n<p>Zabawka jest również doskonałym narzędziem do pracy podczas zajęć sensorycznych rozwijających małą motorykę dorosłym zaś pomoże odreagować stres i wyciszyć emocje.</p>\n<p>W przypadku braku wskazania koloru w formularzu zakupowym w polu wiadomość, dla sprzedawcy - kolor niespodzianka.</p>\n<p>Uwaga: przeznaczone do zabawy pod kontrolą osoby dorosłej.</p>\n<p></p>\n<p>Materiał elastyczny: Silicon</p>', '<h2>Push Pop Bubble Fidget + 3 kulki</h2>\n<p>W zestawie 3 szklane kulki do zabawy oraz 1 siliconowy Push Pop Bubble</p>', 'pop-it-fidget-toy-kuleczki-do-gry-osmiornica', '', '', '', 'Pop it Fidget toy + kuleczki do gry ośmiornica', '', '', '', ''),
(184, 1, 1, '', '', 'slime-pianka-piankolina-superclay', '', '', '', 'Slime PIANKA Piankolina SuperClay', '', '', '', ''),
(185, 1, 1, '<p>CUDOWNY ZAPACH !</p>\n<p>Slime to żelowa masa o konsystencji powoli wypływającej typu galaretka. Slime po ogrzaniu się w dłoniach staje się sprężysty. Slime można wyciągać łyżeczką jak galaretkę lub przechylić buteleczkę i pozwolić jej, powoli wypłynąć z buteleczki.</p>\n<p><br /> - rzeczywiste zdjęcia -</p>\n<h3>Rewelacyjna opcja dla lubiących zabawy ze slime.</h3>\n<p>Istnieje możliwość wyboru koloru. Prosimy wskazać go w formularzu zakupowym w polu wiadomość dla sprzedawcy. W przypadku braku wskazania kolorystyki chłopięcej lub dziewczęcej, pomożemy go Tobie wybrać.</p>\n<p>Ciekawe opakowanie umożliwia również szczelne zamknięcie. Slime nie wysycha. Można cieszyć się nim przez wiele tygodni.</p>\n<p>Nowa formuła gwarantująca ciekawe doznania sensoryczne:</p>\n<p>- masa wydaje się być zimna</p>\n<p>- <strong>doskonała do ćwiczenia małej motoryki</strong></p>\n<p>- po zamknięciu, nie wysycha</p>\n<p>- angażująca przez możliwość łączenia kolorów i cekinów</p>\n<p>- nietoksyczna CE</p>\n<p> </p>\n<p>Wysokość butelki: 14 cm</p>\n<p>POLECAMY JAKO DOSKONAŁY PREZENT ZARÓWNO DLA DZIECKA JAK I OSOBY DOROSŁEJ. REWELACYJNA DO ROZŁADOWANIA NAPIĘCIA JAK I ZABAWY. SUPER JAKO PREZENT LUB JAKO NARZĘDZIE DO REHABILITACJI.</p>', '<p>SLIME - CRYSTAL MUD</p>\n<p>Rewelacyjny Slime SNOOP SNOOPY 1 szt. </p>\n<p>Masa perłowa z galaktycznym pyłem.</p>', 'slime-snoopy-mieniaca-sie-masa-sensoryczna', '', '', '', 'Slime snoopy MIENIĄCA SIĘ masa SENSORYCZNA', '', '', '', ''),
(186, 1, 1, '<p>Slime nietypowy gdyż dzięki swojej ciekawej i satynowej kolorystyce, umożliwia mieszanie kolorów przez ugniatanie. Po ugnieceniu powstaje nowy kolor. Slime ma bardzo ciekawą kremową jednak plastyczną konsystencję niczym glinka. Wywiera bardzo pozytywne wrażenia wzrokowe i dotykowe.</p>\n<p>PUZDERKO MAGIC PUFF </p>\n<p>PUZDERKO UMOŻLIWIA PRZECHOWYWANIE SLIME PO SZCZELNYM JEGO ZAMKNIĘCIU SLIME NIE WYSYCHA.</p>\n<h2>Rewelacyjna opcja dla lubiących zabawy ze slime.</h2>\n<p>PIĘKNE KOLORY, SUPER ZAPACH I MEGA FLUFFY JAK BUDYŃ.</p>\n<p>Możliwość wskazania koloru dla dziewczynki lub dla chłopca, w formularzu zakupowym, w polu wiadomość dla przedawcy. W przypadku braku wskazania pomagamy w wyborze koloru.</p>\n<p>Nowa formuła gwarantująca ciekawe doznania sensoryczne:</p>\n<p>- <strong>masa wydaje się być aksamitna</strong></p>\n<p>- piękny zapach i cudowne kolory</p>\n<p>- doskonała do ćwiczenia małej motoryki</p>\n<p>- <strong>po zamknięciu, nie wysycha</strong></p>\n<p>- angażująca przez możliwość łączenia kolorów i cekinów</p>\n<p>- nietoksyczna CE</p>\n<p> </p>\n<p>POLECAMY JAKO DOSKONAŁY PREZENT ZARÓWNO DLA DZIECKA JAK I OSOBY DOROSŁEJ. REWELACYJNA DO ROZŁADOWANIA NAPIĘCIA JAK I ZABAWY. SUPER JAKO PREZENT LUB JAKO NARZĘDZIE DO REHABILITACJI.</p>\n<p>Średnica puzderka 8,5 cm ; wysokość 4 cm.</p>', '<p>AKSAMITNA MASA 1 szt. = 2 kolory</p>\n<p>W puzderku znajdują się dwa kolory. <strong>Po zmieszaniu </strong>ich i stopniowym ugniataniu, kolory stopniowo sie mieszają i przenikają i <strong>powstaje nowy kolor.</strong></p>', 'slime-puff-masa-plastyczna-sensoryczna-dwa-kolory', '', '', '', 'Slime PUFF masa PLASTYCZNA SENSORYCZNA DWA KOLORY', '', '', '', ''),
(187, 1, 1, '<h2>Niezwykła sensoryczna, galaktyczna przygoda.</h2>\n<p>PRZEPIĘKNE MIENIĄCA SIĘ MASA - ŻELOWA KONSYSTENCJA Z PERŁOWYMI ODBLASKAMI IRAZ DROGĄ MLECZNĄ. SLIME NA TACCE IDEALNEJ DO UGNIATANIA.</p>\n<p>SUPER ZAPACH !!!</p>\n<p> </p>\n<p>IDEALNA DO ZABAWY W STWORZENIE MEGA DUŻEGO SLIMA :). KONSYSTENCJA POWOLI WYLEWAJĄCA SIĘ. PO OGRZANIU W DŁONACH STAJE SĘ CORAZ BARDZIEJ PŁYNNA.</p>\n<p>Nowa formuła gwarantująca ciekawe doznania sensoryczne:</p>\n<p><strong>- idealna do rozciągania</strong></p>\n<p><strong>- doskonała do ugniatania i ćwiczenia małej motoryki</strong></p>\n<p><strong>- po zamknięciu, nie wysycha</strong></p>\n<p><strong>- nietoksyczna, CE</strong></p>\n<p>POLECAMY JAKO DOSKONAŁY PREZENT ZARÓWNO DLA DZIECKA JAK I OSOBY DOROSŁEJ. REWELACYJNA DO ROZŁADOWANIA NAPIĘCIA ORAZ ZABAWY. TAKŻE JAKO NARZĘDZIE DO REHABILITACJI.</p>\n<p>Wymiar opakowania: 20 x 15 cm</p>\n<p>Wymiar tacki ze slime: 11 x 9 cm</p>', '<p>Rewelacyjna masa sensoryczna.</p>\n<p>SUPER SLIME GALAXY</p>', 'super-slime-masa-sensoryczna-galaxy-diy', '', '', '', 'SUPER SLIME masa SENSORYCZNA galaxy DIY', '', '', '', ''),
(188, 1, 1, '<p>ZESTAW SLIME TO WIELE UDANEJ ZABAWY:<br />3 butelki = 3 galaktyczne kolory,<br />3 pojemniki z posypkami <br />3 gniotki squishy<br />_________________________________________________________________</p>\n<p>Oferta zawiera komplet 3 sztuk wysokich tub, każda tuba składa się z dwóch części, w \"piance\" znajdują się kolorowe styropianowe kuleczki do mieszania ze slimeme z zatopionymi gniotkami. Dolna część to delikatna, perłowa masa o przyjemnym zapachu.</p>\n<p>To wspaniały prezent niespodzianka.</p>\n<p>- rzeczywiste zdjęcia -</p>\n<p>Rewelacyjna opcja dla lubiących zabawy ze slime.</p>\n<p> </p>\n<p>3 lody - 3 kolory + baaardzo dużo kolorowych kulek + dodatkowo 3 squishy = udana zabawa na wiele godzin :)<br />Ciekawe opakowania umożliwiają również szczelne zamknięcie aby Slime nie wysechł. Można cieszyć się nim przez wiele tygodni. Konsystencja tego slime to żel powoli wylewający się z opakowania. Sprężysty. Po ogrzaniu w dłoniach staje się coraz bardziej sprężysty.</p>\n<p>-----</p>\n<p>Nowa formuła gwarantująca ciekawe doznania sensoryczne:</p>\n<p>- masa wydaje się być zimna</p>\n<p>- doskonała do ćwiczenia małej motoryki</p>\n<p>- po zamknięciu, nie wysycha</p>\n<p>- angażująca przez możliwość łączenia kolorów i cekinów</p>\n<p>- nietoksyczna CE</p>\n<p>- piękne kolory</p>\n<p> </p>\n<p>Wysokość lodu : 20 cm<br />POLECAMY JAKO DOSKONAŁY PREZENT ZARÓWNO DLA DZIECKA JAK I OSOBY DOROSŁEJ. REWELACYJNA DO ROZŁADOWANIA NAPIĘCIA JAK I ZABAWY. SUPER JAKO PREZENT LUB JAKO NARZĘDZIE DO REHABILITACJI.</p>', '<p>SLIME - MAGIC ICE-CREAM <br />Rewelacyjny zestaw Slime - zestaw to 3 pojemniki lodowe pełne slimów z dodatkowymi kolorowymi kuleczkami i mięciutkimi gniotkami. Po wymieszaniu ze sobą slimów oraz kuleczek tworzy się niesamowita w dotyku masa.</p>', 'slime-squishy-kuleczki-3-szt', '', '', '', 'Slime squishy kuleczki 3 szt.', '', '', '', ''),
(189, 1, 1, '<p>DOSKONAŁA PLASTELINA, KTÓRA NIE BRUDZI I JEST NADZWYCZAJNIE MIŁA W DOTYKU.</p>\n<p> </p>\n<p>NOWA FORMUŁA GWARANTUJE DOSKONAŁĄ SENSORYCZNĄ PRZYGODĘ. MASA JEST BARDZO PLASTYCZNA I MOŻE ZASTĄPIĆ RÓWNIEŻ GLINKĘ. PO POZOSTAWIENIU JEJ NA DŁUŻEJ BEZ ZAMKNIĘCIA - KSZTAŁT ZASTYGA NA STAŁE TWORZĄC CIEKAWE PIANKOWE DZIEŁA.</p>\n<p> </p>\n<p>PO ULEPIENIU TA LEKKA MASA - ODBIJA SIĘ NICZYM PIŁKA. JEST BARDZO ZASKAKUJĄCA. MOŻNA JĄ MIESZAĆ ZE SOBĄ TWORZĄC RÓŻO BARWNE DZIEŁA.</p>\n<p> </p>\n<p>ZAMKNIĘTA SZCZELNIE - NIE WYSYCHA I MOŻNA NIĄ SIĘ BAWIĆ BARDZO DŁUGO JAK NA TEGO TYPU MASY.</p>\n<p>Rewelacyjna opcja dla lubiących zabawy sensoryczne.</p>\n<p> </p>\n<p>Nowa formuła gwarantująca ciekawe doznania sensoryczne:</p>\n<p>Rewelacyjny slime W NOWEJ FORMULE.</p>\n<p>Masa sensoryczna</p>\n<p>- lekka pianka</p>\n<p>- doskonała do ćwiczenia małej motoryki</p>\n<p>- po zamknięciu, nie wysycha</p>\n<p>- nietoksyczna CE</p>\n<p>- nie brudząca</p>\n<p> </p>\n<p>POLECAMY JAKO DOSKONAŁY PREZENT ZARÓWNO DLA DZIECKA JAK I OSOBY DOROSŁEJ. REWELACYJNA DO ROZŁADOWANIA NAPIĘCIA JAK I ZABAWY. SUPER JAKO PREZENT LUB JAKO NARZĘDZIE DO REHABILITACJI.</p>\n<p> </p>\n<p>SPECYFIKACJA:</p>\n<p>- masa ze względu na swoją specyfikę jest lekka</p>\n<p>- objętość 1 paczuszki to ok 5cm x 6cm</p>\n<p>- komplet składa się z 24 paczuszek</p>', '<p>MAGIC CLAY FLUFFY PUFFY</p>\n<p>Jeszcze więcej piankoliny</p>\n<p>ZESTAW 24 sztuk - 12 KOLORÓW</p>', 'slime-pianka-piankolina-superclay-24-sztuki', '', '', '', 'Slime PIANKA Piankolina SuperClay - 24 sztuki', '', '', '', ''),
(190, 1, 1, '<p>* Gwiezdny pył brokatowy</p>\n<p>* Ślicznie perłowe</p>\n<p>* Cudowny zapach</p>\n<p>* Konsystencja typu streatch. Stopniowo wylewająca się z opakowania, po ogrzaniu w dłoniach staje się coraz bardziej aksamitna</p>\n<p>Duża butelka Miś<br />Wysokość butelki 19 cm.</p>\n<p>Szerokość 8 cm.</p>\n<p><br />MASA IDEALNA DO ZABAWY W STWORZENIE MEGA DUŻEGO SLIMA :)</p>\n<p> </p>\n<p>Nowa formuła gwarantująca ciekawe doznania sensoryczne:</p>\n<p>- efekt przelewania się przez ręce - masa wydaje się być zimna</p>\n<p>- doskonała do ćwiczenia małej motoryki</p>\n<p>- po zamknięciu, nie wysycha</p>\n<p>- nietoksyczna CE</p>\n<p> </p>\n<p>POLECAMY JAKO DOSKONAŁY PREZENT ZARÓWNO DLA DZIECKA JAK I OSOBY DOROSŁEJ. REWELACYJNA DO ROZŁADOWANIA NAPIĘCIA JAK I ZABAWY. SUPER JAKO PREZENT LUB JAKO NARZĘDZIE DO REHABILITACJI.</p>\n<p> </p>\n<p> </p>', '<p>Przepiękne mieniące się masy z Galaktycznym Pyłem<br />Zestaw to 2 szt. butelek MIŚ</p>\n<p>Możliwości wskazania zestawu kolorystycznego:</p>\n<p>kiwi - malina</p>\n<p>śliwka - arbuz</p>\n<p>dragon fruit - liczi</p>', 'slime-dwa-misie-zestaw-2-szt', '', '', '', 'Slime dwa misie zestaw 2 szt', '', '', '', ''),
(191, 1, 1, '', '', 'slime-butelki-owocowe-false-water', '', '', '', 'Slime butelki owocowe false water', '', '', '', ''),
(192, 1, 1, '<p>PRZEPIĘKNE MIENIĄCE SIĘ MASY - KOLORY GALAKTYCZNE - ZESTAW ZAWIERA 2 BUTELECZKI W TONACJI RÓŻOWEJ, FIOLETOWO NIEBIESKIEJ I ZIELONO FIOLETOWEJ. PRZEPIĘKNIE MIENIĄCE SIĘ NICZYM DROGA MLECZNA ;)</p>\n<p>WSZYSTKIE PIĘKNE GALAKTYCZNE Z GWIEZDNYM PYŁEM</p>\n<p>SUPER ZAPACH !!!</p>\n<p> </p>\n<p>* * * * * ** * * * * *</p>\n<p>MASA SENSORYCZNA</p>\n<p>DUŻA BUTELKA O WYSOKOŚCI 10 cm ; ŚREDNICA DNA 6,5 cm</p>\n<p>Pojemność 1 zbiorniczka ok 230 ml</p>\n<p>Masa netto ok 275 gr; brutto 300 gr</p>\n<p>Waga zestawu ok 1 kg</p>\n<p>JEDWABISTA W DOTYKU, NIEZWYKLE PRZYJEMNA, ZŁUDZENIE WILGOTNEJ I ZIMNEJ. IDEALNA DO ZABAWY W STWORZENIE MEGA DUŻEGO SLIMA :)</p>\n<p> </p>\n<p>Nowa formuła gwarantująca ciekawe doznania sensoryczne:</p>\n<p>- idealna do rozciągania - masa wydaje się być zimna</p>\n<p>- doskonała do ćwiczenia małej motoryki</p>\n<p>- po zamknięciu, nie wysycha</p>\n<p>- nietoksyczna, CE</p>\n<p> </p>\n<p>POLECAMY JAKO DOSKONAŁY PREZENT ZARÓWNO DLA DZIECKA JAK I OSOBY DOROSŁEJ. REWELACYJNA DO ROZŁADOWANIA NAPIĘCIA JAK I ZABAWY. TAKŻE JAKO NARZĘDZIE DO REHABILITACJI.</p>\n<p> </p>\n<p>Istnieje możliwość wskazania wyboru koloru zestawu w formularzu zakupowym w polu wiadomość dla sprzedawcy. W przypadku braku wskazania, zestaw niespodzianka - zawsze z jednym galaktycznym slime.</p>', '<p>PRZEPIĘKNE BUTELKI - GALAXY SLIME<br />MIENIĄCY SIĘ - niezwykła sensoryczna przygoda.<br />ZESTAW = 2 BUTELKI SLIME \"GALAXY MILK\"</p>', 'slime-galaxy-butelki-2-szt', '', '', '', 'Slime galaxy butelki 2 szt.', '', '', '', ''),
(193, 1, 1, '<p>ZESTAW = 2 GWIAZDY SLIME \"GALAXY MILK\"<br />1 FIOLETOWA + 1 KORALOWA</p>\n<p>* * *** ** * **** ** * * *</p>\n<p>PRZEPIĘKNE MIENIĄCE SIĘ MASY - KOLORY GALAKTYCZNE - ZESTAW ZAWIERA 2 BUTELECZKI W TONACJI TURKUSOWO/NIEBIESKIEJ LUB W TONACJI NIEBIESKO/KORALOWEJ. PRZEPIĘKNIE MIENIĄCE SIĘ NICZYM DROGA MLECZNA ;)</p>\n<p>WSZYSTKIE PIĘKNE GALAKTYCZNE Z GWIEZDNYM PYŁEM</p>\n<p>FORMUŁA: PRZELEWAJĄCA SIĘ PRZEZ RĘCE, UCIEKJĄCA.</p>\n<p>SUPER ZAPACH !!!</p>\n<p>* * * * * ** * * * * *</p>\n<p>2 x SŁOICZEK O WYSOKOŚCI 11,5 cm</p>\n<p>Masa netto jednej sztuki to ok. 240 g; brutto 270 g</p>\n<p> </p>\n<p>Nowa formuła gwarantująca ciekawe doznania sensoryczne:</p>\n<p>- idealna do zabawy w łapanie z ręki do ręki uciekającej masy</p>\n<p>- masa wydaje się być zimna</p>\n<p>- doskonała do ćwiczenia małej motoryki</p>\n<p>- po zamknięciu, nie wysycha</p>\n<p>- nietoksyczna, CE</p>\n<p> </p>\n<p>POLECAMY JAKO DOSKONAŁY PREZENT ZARÓWNO DLA DZIECKA JAK I OSOBY DOROSŁEJ. REWELACYJNA DO ROZŁADOWANIA NAPIĘCIA JAK I ZABAWY. TAKŻE JAKO NARZĘDZIE DO REHABILITACJI.</p>\n<p>IDEALNA DO ZABAWY W STWORZENIE MEGA DUŻEGO SLIMA :).</p>', '<p>PRZEPIĘKNE BUTELKI - GWIEZDNE GALAXY SLIME<br />MIENIĄCY SIĘ - niezwykła sensoryczna przygoda.</p>', 'gwiezdny-galaxy-slime-deszcz-meteorytow-2-szt', '', '', '', 'Gwiezdny Galaxy Slime deszcz meteorytów 2 szt.', '', '', '', ''),
(194, 1, 1, '<p>CIASTECZKOWY SLIME 1 SZT.</p>\n<p>******* ***** ******* *****</p>\n<p>DELIKATNIE PIANKOWE MASY - ŻELOWA, PRZELEWAJĄCA SIĘ MASA NIE POZOSTAWIAJĄCA PO SOBIE ŚLADU NA DŁONIACH. W KUBECZKU SLIME Z POSYPKĄ.</p>\n<p><br />IDEALNA DO ZABAWY W STWORZENIE MEGA DUŻEGO SLIMA :)</p>\n<p> </p>\n<p>Nowa formuła gwarantująca ciekawe doznania sensoryczne:</p>\n<p>- efekt przelewania się przez ręce - masa wydaje się być zimna</p>\n<p>- doskonała do ćwiczenia małej motoryki</p>\n<p>- po zamknięciu, nie wysycha</p>\n<p>- nietoksyczna CE</p>\n<p> </p>\n<p>POLECAMY JAKO DOSKONAŁY PREZENT ZARÓWNO DLA DZIECKA JAK I OSOBY DOROSŁEJ. REWELACYJNA DO ROZŁADOWANIA NAPIĘCIA JAK I ZABAWY. SUPER JAKO PREZENT LUB JAKO NARZĘDZIE DO REHABILITACJI.</p>', '<p>Rewelacyjny slime - niezwykła sensoryczna przygoda. ZABAWNE KUBECZKI - CIASTECZKA</p>', 'slime-oreo-masa-plastyczna-sensoryczna', '', '', '', 'Slime Oreo Masa plastyczna sensoryczna', '', '', '', ''),
(195, 1, 1, '<p>Czym jest Mystery BOX SquishySquishies?</p>\n<p>Mystery BOX SquishySquishies to fantastyczne pudełko pełne specjalnie wyselekcjonowanych mas plastycznych dla prawdziwych Fanów sensorycznych przygód.</p>\n<p>Przekazujemy Ci pudełko pełne rewelacyjnych „skarbów”.</p>\n<p>___________</p>\n<p>Masy plastyczne to również doskonałe narzędzia do pracy podczas zajęć sensorycznych rozwijających małą motorykę i podbudzających zmysły. Praca z masami zapewnia również zabawę przez długi czas.</p>', '<p>MYSTERY BOX Slime od SquishySquishies <br />Zestaw 5 kolorów specjalnie wyselekcjonowanych mas plastycznych dla prawdziwych Fanów sensorycznych przygód.<br />+ Posypka do ozdabiania i mieszania z masą.</p>\n<p>?</p>\n<p>Istnieje możliwość wyboru kolorystyki dla dziewczyny lub dla chłopaka</p>', 'mystery-box-slime', '', '', '', 'Mystery BOX Slime', '', '', '', ''),
(196, 1, 1, '<p>Rewelacyjny slime GALAXY PERŁOWY - niezwykła sensoryczna przygoda.</p>\n<p>Komplet 3 sztuk</p>\n<p>MASA SENSORYCZNA</p>\n<p>JEDWABISTA W DOTYKU, NIEZWYKLE PRZYJEMNA, ZŁUDZENIE WILGOTNEJ. DODATKOWY EFEKT \"PRZELEWANIA SIĘ\" PRZEZ RĘCE. ZABAWA W UTRZYMANIE JEJ W DŁONIACH JEST DODATKOWĄ ATRAKCJĄ :)</p>\n<p>Rewelacyjna opcja dla lubiących zabawy ze slime. </p>\n<p>Nowa formuła gwarantująca ciekawe doznania sensoryczne:</p>\n<p>- efekt przelewania się przez ręce - masa wydaje się być zimna</p>\n<p>- doskonała do ćwiczenia małej motoryki</p>\n<p>- po zamknięciu, nie wysycha</p>\n<p>- nietoksyczna CE</p>\n<p>POLECAMY JAKO DOSKONAŁY PREZENT ZARÓWNO DLA DZIECKA JAK I OSOBY DOROSŁEJ. REWELACYJNA DO ROZŁADOWANIA NAPIĘCIA JAK I ZABAWY. SUPER JAKO PREZENT LUB JAKO NARZĘDZIE DO REHABILITACJI.</p>', '<p>Slime Masa Sensoryczna Uciekająca Perłowa Galaxy</p>', 'slime-galaktyczne-kule-komplet-3-szt', '', '', '', 'Slime galaktyczne kule komplet 3 szt.', '', '', '', ''),
(197, 1, 1, '', '', 'slime-pastel-poop', '', '', '', 'Slime pastel POOP', '', '', '', ''),
(198, 1, 1, '<p>MASA SENSORYCZNA<br />ŻELOWA I CIEKAWA W DOTYKU, ZŁUDZENIE WILGOTNEJ I ZIMNEJ MASY. PERŁOWY I KOLOROWY SLIME.</p>\n<p>Rewelacyjna opcja dla lubiących zabawy ze slime. Super rozciągliwa.</p>\n<p>NA NASZEJ AUKCJI BUTELECZKA O WYSOKOŚCI 11CM. NA ZDJĘCIU REALNA, SPRZEDAWANA ILOŚĆ ;)</p>', '<p>Rewelacyjny slime GALAXY PERŁOWY - niezwykła sensoryczna przygoda.</p>\n<p>PIĘKNE KOLORY<br />AUKCJA DOTYCZY 1 SZT BUTELECZKI</p>', 'slime-unicorn-poop', '', '', '', 'Slime unicorn POOP', '', '', '', ''),
(199, 1, 1, '<p>Klasyczny długopis w super wydaniu. Wesoły do tego antystresowy FIDGET TOYS na końcu każdego długopisu. Mięciutki SQUISHY Jednorożec.</p>\n<p>________________________________________________________________</p>\n<p>WESOŁY ANYSTRESOWY Z FIDGET TOYS</p>', '<p>Rewelacyjny długopis w funkcją piłeczki strzelającej.</p>\n<p>MIĘCIUTKI I WESOŁY DŁUGOPIS ANTYSTRESOWY</p>', 'dlugopis-wyskakujacy-jednorozec-anystresowy-fidget-toy', '', '', '', 'Długopis wyskakujący jednorożec ANYSTRESOWY FIDGET TOY', '', '', '', ''),
(200, 1, 1, '<p>Śliczny piórnik TUBA SASZETKA z rewelacyjnym efektem - gumowany aksamitny w dotyku.</p>\n<p> </p>\n<p>Wymiary:</p>\n<p>długość dołu 20cm</p>\n<p>szerokość boku 7cm</p>\n<p>wysokość 7cm</p>\n<p>_____________________________________</p>\n<p>* Wzór prosimy wskazać we wiadomości dla sprzedającego w formularzu zakupowym w polu wiadomość dla sprzedawcy. W przypadku braku wskazania wzór niespodzianka.</p>\n<p>* Piórnik sprzedawany jest bez długopisu umieszczonego na zdjęciu w celu ukazania jego rozmiarów.</p>', '<p>KOTY KOT KOTEK \"Noughty Cat\" <br />Ciekawy gadżet to również doskonały pomysł na kosmetyczkę. Saszetka wykonana została z nieprzemakalnego materiału łatwego do czyszczenia. Piórnik pomieści wszystkie niezbędne przybory. Bardzo miło koci piórnik! ;)</p>', 'piornik-szkolny-czarny-bialy-kot-kotek', '', '', '', 'Piórnik szkolny czarny biały kot kotek', '', '', '', ''),
(201, 1, 1, '<p>Polecamy jako piórnik, kosmetyczkę, lub organizer do torebki. Saszetka wykonana została z łatwego do czyszczenia materiału PVC - można go z łatwością wymyć, dzięki czemu doskonała będzie zarówno na kosmetyki i kredki jak i na długopisy i inne akcesoria szkolne.</p>\n<p>Wymiary:</p>\n<p>długość 21 cm</p>\n<p>szerokość 7 cm</p>\n<p>wysokość 9 cm</p>\n<p>_____________________________________</p>\n<p>DŁUGOPISY WIDNIEJĄCE NA ZDJĘCIACH SĄ ELEMENTEM STYLIZACJI MAJĄCEJ NA CELU UKAZANIE WIELKOŚCI. NIE SĄ SPRZEDAWANE Z PIÓRNIKIEM.</p>', '<p>Piórnik z super wygodnym, dużym suwakiem.<br />Transparentny z niesamowitym efektem hologramu. Materiał z którego został wykonany - przepięknie opalizuje w świetle, odbijając wszystkie kolory niczym kameleon.</p>\n<p>Efekt jest rewelacyjny !!!</p>\n<p>Dodatkowo podkreślają go modne wzory.</p>\n<p>Do wyboru:</p>\n<p>holo pantera</p>\n<p>holo syrenka</p>\n<p>holo róż</p>\n<p>holo plastry miodu</p>\n<p> </p>', 'piornik-szkolny-holo-z-duzym-suwakiem', '', '', '', 'Piórnik szkolny holo z dużym suwakiem', '', '', '', ''),
(202, 1, 1, '<p>W przypadku braku wskazania koloru loda (czekoladowy lód, truskawkowy lód, waniliowy lód, pistacjowy lód) wzór niespodzianka.</p>\n<p>Wszystkie bardzo apetyczne. Kolor wkładu czarny.</p>', '<p>Zestaw ciekawych i potrzebnych gadżetów. Ścieralny długopis, piórnik w jednym z najmodniejszych wzorów oraz niezbędny pop it w wersji kieszonkowej :).</p>\n<h2>ZESTAW DO SZKOŁY + POP IT</h2>\n<p><br />1. PIÓRNIK TUBA Z KOLOROWYMI PIÓRKAMI</p>\n<p>2. DŁUGOPIS ŚCIERALNY</p>\n<p>3. APETYCZNY CIENKOPIS</p>\n<p>4. POP IT BRELOK NIESPODZINKA</p>', 'piornik-szkolny-tuba-piorka', '', '', '', 'Piórnik szkolny tuba piórka', '', '', '', ''),
(203, 1, 1, '<p>Piórnik Zipper HOLO Jednorożec<br />Polecamy jako piórnik, kosmetyczkę, lub organizer do torebki. Saszetka wykonana została z łatwego do czyszczenia materiału PVC - można go z łatwością wymyć, dzięki czemu doskonała będzie zarówno na kosmetyki i kredki jak i na długopisy i inne akcesoria szkolne.</p>\n<p>Wymiary:</p>\n<p>długość 21 cm</p>\n<p>szerokość 7 cm</p>\n<p>wysokość 9 cm</p>\n<p>_____________________________________</p>\n<p>DŁUGOPISY WIDNIEJĄCE NA ZDJĘCIACH SĄ ELEMENTEM STYLIZACJI MAJĄCEJ NA CELU UKAZANIE WIELKOŚCI. NIE SĄ SPRZEDAWANE Z PIÓRNIKIEM.</p>', '<h2>Piórnik z super wygodnym, dużym suwakiem.</h2>\n<p><br />Transparentny z niesamowitym efektem hologramu. Materiał z którego został wykonany - przepięknie opalizuje w świetle, odbijając wszystkie kolory niczym kameleon. Efekt jest rewelacyjny !!! Dodatkowo podkreślają go wzory jednorożców.</p>', 'piornik-szkolny-z-duzym-suwakiem-jednorozec-holo', '', '', '', 'Piórnik szkolny z dużym suwakiem jednorożec HOLO', '', '', '', ''),
(204, 1, 1, '<p>Istnieje możliwość wyboru koloru suwaka we wiadomości dla sprzedającego w formularzu zakupowym. W przypadku braku wskazania wysyłamy kolor suwaka niespodziankę. Można wskazać kolorystykę dla dziewczynki lub dla chłopca.</p>\n<p>Tęczowy Piórnik<br />Polecamy jako piórnik, kosmetyczkę, lub organizer do torebki. Saszetka wykonana została z łatwego do czyszczenia materiału PVC - można go z łatwością wymyć, dzięki czemu doskonała będzie zarówno na kosmetyki i kredki jak i na długopisy i inne akcesoria szkolne.</p>\n<p> </p>\n<p>Wymiary:</p>\n<p>długość 21 cm</p>\n<p>szerokość 7 cm</p>\n<p>wysokość 9 cm</p>\n<p>_____________________________________</p>\n<p>DŁUGOPISY WIDNIEJĄCE NA ZDJĘCIACH SĄ ELEMENTEM STYLIZACJI MAJĄCEJ NA CELU UKAZANIE WIELKOŚCI. NIE SĄ SPRZEDAWANE Z PIÓRNIKIEM.</p>', '<p><strong>Piórnik z super wygodnym, dużym suwakiem.</strong><br />Transparentny w przepięknych kolorach. Materiał z którego został wykonany - przepięknie opalizuje w świetle, odbijając wszystkie kolory niczym kameleon. Efekt jest rewelacyjny !!! Dodatkowo podkreślają go modne wzory.</p>\n<p>Tęczowy Piórnik<br />Polecamy jako piórnik, kosmetyczkę, lub organizer do torebki. Saszetka wykonana została z łatwego do czyszczenia materiału PVC - można go z łatwością wymyć, dzięki czemu doskonała będzie zarówno na kosmetyki i kredki jak i na długopisy i inne akcesoria szkolne.</p>', 'piornik-z-duzym-suwakiem-teczowy', '', '', '', 'Piórnik z dużym suwakiem tęczowy', '', '', '', ''),
(205, 1, 1, '<p><strong>Idealne zarówno dla ilustratorów jak i dla dzieci</strong></p>\n<p><strong>Bezsmugowe malowanie.</strong></p>\n<p><strong>Łatwe wypełnianie dużych powierzchni</strong></p>\n<p><strong>Dwie końcówki pozwalają na dopracowanie grafiki w każdym calu</strong></p>\n<p><strong>Intensywne barwy</strong></p>\n<p><strong>Możliwość blendowania (mieszania) kolorów</strong></p>\n<p></p>\n<p>Grafiki stworzone markerami alkoholowymi po wyschnięciu są wodoodporne.</p>\n<p></p>', '<p>Zestaw Markerów alkoholowych wysokiej jakości Touch <strong>w eleganckim etui</strong></p>\n<p>Markery wyposażone są w <strong>dwie końcówk</strong>i - <strong>grubą - płaską</strong> (3-6 mm) skośnie ściętą idealna do wypełniania oraz <strong>okrągłą</strong> - <strong>cienką</strong> (1.2 mm) do linii i detali.</p>', 'markery-alkoholowe-touch-torba-zestaw-80-szt-dwustronne', '', '', '', 'Markery alkoholowe Touch torba zestaw 80 szt dwustronne', '', '', '', ''),
