(210, 1, 1, '<p>Idealnie odwzorowana maskotka z gry Poppy Playtime HUGGY WUGGY</p>\n<p>Jej wysokość to 40 cm!</p>\n<p>Materiał : Miękki i przyjemny</p>\n<p>Miła w dotyku!</p>\n<p>Idealna alternatywa dla poduszki, dzięki której się wyśpisz, spełni również funkcje ozdoby do Twojego pokoju.</p>\n<p>Dzięki rzepom na rękach, można zmieniać pozycje zabawki</p>\n<p>Najlepszy pomysł na prezent!</p>', '<p>Pluszowa maskotka HUGGY to idealny prezent dla wszystkich miłośników tej Postaci z gry komputerowej czy Youtube!</p>', 'kissy-missy-rozowa-huggy-wuggy-maskotka-poppy-playtime-pluszowa-zabawka-40-cm', '', '', '', 'KISSY MISSY RÓŻOWA Huggy Wuggy maskotka POPPY PLAYTIME PLUSZOWA ZABAWKA 40 CM', '', '', '', ''),
(211, 1, 1, '<p>Pluszowa maskotka Kissy Missy HUGGY to idealny prezent dla wszystkich miłośników tej Postaci z gry komputerowej czy Youtube!</p>\n<p>Idealnie odwzorowana maskotka z gry Poppy Playtime HUGGY WUGGY</p>\n<p>Jej wysokość to 40 cm!</p>\n<p>Materiał : Miękki i przyjemny</p>\n<p>Miła w dotyku!</p>\n<p>Idealna alternatywa dla poduszki, dzięki której się wyśpisz, spełni również funkcje ozdoby do Twojego pokoju.</p>\n<p>Dzięki rzepom na rękach, można zmieniać pozycje zabawki</p>\n<p>Najlepszy pomysł na prezent!</p>', '<p>Pluszowa Zabawka 40cm</p>', 'kissy-missy-huggy-wuggy-rozowa-maskotka', '', '', '', 'Kissy Missy Huggy Wuggy różowa maskotka', '', '', '', ''),
(212, 1, 1, '<p>Idealnie odwzorowana maskotka z gry Poppy Playtime HUGGY WUGGY</p>\n<p>Jej wysokość to 40 cm!</p>\n<p>Materiał : Miękki i przyjemny</p>\n<p>Miła w dotyku!</p>\n<p>Idealna alternatywa dla poduszki, dzięki której się wyśpisz, spełni również funkcje ozdoby do Twojego pokoju.</p>\n<p>Dzięki rzepom na rękach, można zmieniać pozycje zabawki</p>\n<p>Najlepszy pomysł na prezent!</p>', '<p>Pluszowa maskotka HUGGY to idealny prezent dla wszystkich miłośników tej Postaci z gry komputerowej czy Youtube!</p>', 'huggy-wuggy-maskotka-poppy-playtime-pluszowa-zabawka-40-cm', '', '', '', 'Huggy Wuggy maskotka POPPY PLAYTIME PLUSZOWA ZABAWKA 40 CM', '', '', '', ''),
(213, 1, 1, '', '', 'koszykowka-elektroniczna-kula-dunk-led', '', '', '', 'Koszykówka elektroniczna kula dunk LED', '', '', '', ''),
(214, 1, 1, '<p>1 FIOLETOWA + 1 KORALOWA</p>\n<p>PRZEPIĘKNE MIENIĄCE SIĘ MASY - KOLORY GALAKTYCZNE - ZESTAW ZAWIERA 2 BUTELECZKI W TONACJI RÓŻOWEJ, FIOLETOWO NIEBIESKIEJ I ZIELONO FIOLETOWEJ. PRZEPIĘKNIE MIENIĄCE SIĘ NICZYM DROGA MLECZNA ;)</p>\n<p>WSZYSTKIE PIĘKNE GALAKTYCZNE Z GWIEZDNYM PYŁEM</p>\n<p>SUPER ZAPACH !!!</p>\n<p>MASA SENSORYCZNA</p>\n<p>SŁOICZEK O WYSOKOŚCI 10 cm ; ŚREDNICA DNA 6,5 cm</p>\n<p>Pojemność 1 zbiorniczka ok 230 ml</p>\n<p>Masa netto ok 275 gr; brutto 300 gr</p>\n<p>IDEALNA DO ZABAWY W STWORZENIE MEGA DUŻEGO SLIMA :). KONSYSTENCJA POWOLI WYLEWAJĄCA SIĘ. PO OGRZANIU W DŁONACH STAJE SĘ CORAZ BARDZIEJ PŁYNNA.</p>\n<p> </p>\n<p>Nowa formuła gwarantująca ciekawe doznania sensoryczne:</p>\n<p>- idealna do rozciągania - masa wydaje się być zimna</p>\n<p>- doskonała do ćwiczenia małej motoryki</p>\n<p>- po zamknięciu, nie wysycha</p>\n<p>- nietoksyczna, CE</p>\n<p> </p>\n<p>POLECAMY JAKO DOSKONAŁY PREZENT ZARÓWNO DLA DZIECKA JAK I OSOBY DOROSŁEJ. REWELACYJNA DO ROZŁADOWANIA NAPIĘCIA JAK I ZABAWY. TAKŻE JAKO NARZĘDZIE DO REHABILITACJI.</p>', '<p>PRZEPIĘKNE BUTELKI - GALAXY SLIME<br />MIENIĄCY SIĘ - niezwykła sensoryczna przygoda.<br />ZESTAW = 2 BUTELKI SLIME \"GALAXY MILK\"</p>\n<p>1 FIOLETOWA + 1 KORALOWA</p>', 'slime-galaxy-mieniaca-sie-masa-2-szt', '', '', '', 'Slime galaxy mieniąca się masa 2 szt.', '', '', '', ''),
(215, 1, 1, '<h2>Mystery Fidget BOX to doskonały pomysł na prezent! <br />Idealny dla dzieci, młodzieży. Zabawne gadżety ucieszą również dorosłych.</h2>\n<p> </p>\n<p>SquishySquishies istnieje od 2015 roku, specjalizuje się w sprzedaży zabawek sensorycznych, squishy, gniotków, mas plastycznych typu slime i wielu inny zabawek kreatywnych.</p>\n<h2>Zawartość opakowania: 6 fidgetów Na zdjęciach w ofercie znajdują się wszystkie wzory możliwe do znalezienia.</h2>\n<p>Wszystkie grafiki poniżej to rzeczywiste zdjęcia produktów z pudełka.</p>\n<p>Zabawki to również doskonałe narzędzia do pracy podczas zajęć sensorycznych rozwijających małą motorykę, dorosłym zaś pomogą odreagować stres i wyciszyć emocje.</p>\n<p> </p>\n<p>Simple dimple, Simple dimple breloczki, POP IT - push bubble, POP IT breloczki, wężyki twister, kolorowe kule logiczne, gniotki mochi squishy, opaski pop it, kostki antystresowe infinity, kostki sensoryczne, gniotki squishy, kule sensoryczne z kulkami orbeez, pop tubes, Snappery, Sticky gniotki, noodle stretch strings MONKEY NOODLE, Simple dimple spinnery, antystresowe pierścienie magnetyczne, długopisy fidget, fistaszki, fasolki, wiewiórki .... :)</p>', '<p>Zestaw gadżetów antystresowych niespodzianek</p>\n<p></p>\n<p>Do wyboru trzy wersje specjalnie wyselekcjonowane:</p>\n<p></p>\n<p>- dla dziewczyny</p>\n<p>- dla chłopaka</p>\n<p>- miks dla chłopaka i dla dziewczyny</p>', 'mystery-box-fidget-toys-xl', '', '', '', 'Mystery BOX Fidget toys XL', '', '', '', ''),
(216, 1, 1, '', '', 'mystery-box-fidget-toys-xxl', '', '', '', 'Mystery BOX Fidget toys XXL', '', '', '', ''),
(217, 1, 1, '', '', 'mystery-box-fidget-toys-jumbo', '', '', '', 'Mystery BOX Fidget toys JUMBO', '', '', '', '');
